/**
 * KeyPressState
 */
GF.KeyPressState = {
    NONE: 0,
    PRESSED: 1,
    PRESSING: 2,
    RELEASED: 3
}

/**
 * Input Manager
 */
GF.GameInputManager = class GameInputManager {
    constructor(game){
        this._game = game;
        this._gamepads = null;
        this._keyboard = null;
        this._keyBinds = null;

        this._mouseClickCallback = null;
        this._mouseDownCallback = null;
        this._mouseDownCallback = null;
        this._mouseMoveCallback = null;
    }

    //#region API

    /**
     * If gamepad button is pressed
     * @param {number} gamepad the gamepad index
     * @param {number} button the button index
     */
    isGamepadButtonPressed(gamepad, button) {
        return this._gamepads[gamepad] != null ? this._gamepads[gamepad].buttons[button].pressed : false;
    }

    /**
     * Get gamepad axis state
     * @param {number} gamepad the gamepad index
     * @param {number} axis the axis index
     */
    getGamepadAxisState(gamepad, axis) {
        return this._gamepads[gamepad] != null ? Math.round(this._gamepads[gamepad].axes[axis] * 100) / 100 : 0;
    }

    /**
     * If key is pressed
     * @param {string} key 
     */
    isPressed(key) {
        return this._keyboard.pressed(key);
    }

    /**
     * Bind to key press
     * @param {string} key the key
     * @param {KeyPressState} type if key press is PRESSED, PRESSING or RELEASED
     * @param {function} callback the callback
     * @return subscription
     */
    bind(key, type, callback) {
        if (this._keyBinds[key] == null) {
            this._keyBinds[key] = {
                type: "keyboard",
                state: GF.KeyPressState.NONE,
                [GF.KeyPressState.PRESSED]: [],
                [GF.KeyPressState.PRESSING]: [],
                [GF.KeyPressState.RELEASED]: []
            }
        }

        this._keyBinds[key][type].push(callback);

        return {key: key, type: type, callback: callback};
    }

    /**
     * Bind to gamepad button press
     * @param {number} gamepad the gamepad index
     * @param {Object} gamepadKey the gamepad key combination Ex: [0, 3] -> GamePad 0, Button 3
     * @param {KeyPressState} type if button press is PRESSED, PRESSING or RELEASED
     * @param {function} callback the callback
     * @return subscription
     */
    bindGamePad(gamepadKey, type, callback) {
        if (this._keyBinds[gamepadKey] == null) {
            this._keyBinds[gamepadKey] = {
                type: "gamepad",
                gamepad: gamepadKey[0],
                button: gamepadKey[1],
                state: GF.KeyPressState.NONE,
                [GF.KeyPressState.PRESSED]: [],
                [GF.KeyPressState.PRESSING]: [],
                [GF.KeyPressState.RELEASED]: []
            }
        }

        this._keyBinds[gamepadKey][type].push(callback);

        return {key: gamepadKey, type: type, callback: callback};
    }

    /**
     * Unbind to key event by subscription
     * @param {any} subscription 
     */
    unbind(subscription) {
        if (subscription != null) {
            var keyBind = this._keyBinds[subscription.key];
            if (keyBind != null) {
                var keyBindType = this._keyBinds[subscription.key][subscription.type];
                if (keyBindType != null) {
                    var index = keyBindType.indexOf(subscription.callback);
                    if (index >= 0) {
                        keyBindType.splice(index, 1);
                    }
                }
            }
        }
    }

    /**
     * Bind mouse event
     * @param {MouseEvent} event the mouse event
     * @param {function} callback the callback
     */
    bindMouseEvent(event, callback) {
        if (this.mouseEventBinds == null) {
            this.mouseEventBinds = {};
        }

        if (this.mouseEventBinds[event] == null) {
            this.mouseEventBinds[event] = []
        }

        this.mouseEventBinds[event].push(callback);

        if (event === "click" && this._mouseClickCallback == null) {
            this._mouseClickCallback = this.mouseClick.bind(this);
            document.addEventListener("click", this._mouseClickCallback, false);
        }
        else if (event === "down" && this._mouseDownCallback == null) {
            this._mouseDownCallback = this.mouseDown.bind(this);
            document.addEventListener("mousedown", this._mouseDownCallback, false);
        }
        else if (event === "up" && this._mouseDownCallback == null) {
            this._mouseDownCallback = this.mouseUp.bind(this);
            document.addEventListener("mouseup", this._mouseDownCallback, false);
        }
        else if (event === "move" && this._mouseMoveCallback == null) {
            this._mouseMoveCallback = this.mouseMove.bind(this);
            document.addEventListener("mousemove", this._mouseMoveCallback, false);
        } else if (event === "wheel" && this._mouseMoveCallback == null) {
            this.mouseWheelCallback = this.mouseWheel.bind(this);
            document.addEventListener("mousewheel", this.mouseWheelCallback, false);
        }

        return {event: event, callback: callback};
    }

    /**
     * Unbind to key event by subscription
     * @param {any} subscription 
     */
    unbindMouseEvent(subscription) {
        if (subscription != null) {
            var callbacks = this.mouseEventBinds[subscription.event];
            if (callbacks != null) {
                var index = callbacks.indexOf(subscription.callback);
                if (index >= 0) {
                    callbacks.splice(index, 1);
                }
            }
        }
    }

    /**
     * Unbind all events of a key
     * @param {string} key the key
     */
    unbindAll(key) {
        if (key != null) {
            this._keyBinds[key] = {
                state: GF.KeyPressState.NONE,
                [GF.KeyPressState.PRESSED]: [],
                [GF.KeyPressState.PRESSING]: [],
                [GF.KeyPressState.RELEASED]: []
            };
        }
    }

    /**
     * Listen for any kind of input
     * @param {function} callback 
     */
    listenForInput(callback) {
        if (this.listenForInputCallbacks == null) {
            this.listenForInputCallbacks = [];
        }
        this.listenForInputCallbacks.push(callback);
    }

    /**
     * Stop Listen for any kind of input
     * @param {function} callback 
     */
    stopListenForInput(callback) {
        if (this.listenForInputCallbacks != null) {
            const index = this.listenForInputCallbacks.indexOf(callback);
            if (index >= 0) {
                this.listenForInputCallbacks.splice(index, 1);
            }
        }
    }

    //#endregion

    // #region Internal

    /**
     * Mouse wheel
     * @param {MouseEvent} event 
     */
     mouseWheel(event) {
        if (this.mouseEventBinds != null) {
            if (this.mouseEventBinds['wheel'] instanceof Array) {
                for (const callback of this.mouseEventBinds['wheel']) {
                    callback(event);
                }
            }
        }
    }


    /**
     * Mouse move
     * @param {MouseEvent} event 
     */
    mouseMove(event) {
        if (this.mouseEventBinds != null) {
            if (this.mouseEventBinds['move'] instanceof Array) {
                for (const callback of this.mouseEventBinds['move']) {
                    callback(event);
                }
            }
        }
    }

    /**
     * Mouse up
     * @param {MouseEvent} event 
     */
    mouseUp(event) {
        if (this.mouseEventBinds != null) {
            if (this.mouseEventBinds['up'] instanceof Array) {
                for (const callback of this.mouseEventBinds['up']) {
                    callback(event);
                }
            }
        }
    }

    /**
     * Mouse down
     * @param {MouseEvent} event 
     */
    mouseDown(event) {
        if (this.mouseEventBinds != null) {
            if (this.mouseEventBinds['down'] instanceof Array) {
                for (const callback of this.mouseEventBinds['down']) {
                    callback(event);
                }
            }
        }
    }

    /**
     * Mouse click
     * @param {MouseEvent} event 
     */
    mouseClick(event) {
        if (this.mouseEventBinds != null) {
            if (this.mouseEventBinds['click'] instanceof Array) {
                for (const callback of this.mouseEventBinds['click']) {
                    callback(event);
                }
            }
        }
    }

    /**
     * Copy gamepads initial values
     */
    _copyGamePadInitialValues() {
        setTimeout(() => {
            this._gamepads = navigator.getGamepads ? navigator.getGamepads() : (navigator.webkitGetGamepads ? navigator.webkitGetGamepads : []);

            this._gamepadsInitialValues = [];
            for (var g = 0; g < this._gamepads.length; g++) {
                if (this._gamepads[g] != null) {
                    // copy gamepad buttons
                    this._gamepadsInitialValues.push({
                        buttons: this._gamepads[g].buttons.map((b) => {return {pressed: b.pressed}}),
                        axes: JSON.parse(JSON.stringify(this._gamepads[g].axes))
                    });
                } else {
                    this._gamepadsInitialValues.push(null);
                }
            }
        }, 500)
    }

    //#endregion

    //#region system

    /**
     * init
     */
    _init() {
        this._keyBinds = {};
        this._keyboard = new THREEx.KeyboardState();

        this._keyboard.onKeyChangeCallback = (key) => {
            if (this.listenForInputCallbacks != null) {
                for (const callback of this.listenForInputCallbacks) {
                    callback(GF.GAME_CONTROL_TYPE.KEYBOARD, key);
                }
            }
        };

        // gamepad
        this._gamepads = {};

        // connected handler
        this._gamepadHandlerConnected = (event) => {
            console.log("[INFO] (Gamepad connected): " + event.gamepad.id);
            this._game.broadcastMessage(INPUT_GAMEPAD_CONNECTED, {gamepad: event.gamepad.index});

            this._copyGamePadInitialValues();
        }

        // disconnected handler
        this._gamepadHandlerDisconnected = (event) => {
            console.log("[INFO] (Gamepad disconnected): " + event.gamepad.id);
            this._game.broadcastMessage(INPUT_GAMEPAD_DISCONNECTED, {gamepad: event.gamepad.index});

            this._copyGamePadInitialValues();
        }

        window.addEventListener("gamepadconnected", this._gamepadHandlerConnected, false);
        window.addEventListener("gamepaddisconnected", this._gamepadHandlerDisconnected, false);
    }

    /**
     * update
     * @param {number} delta 
     */
    _update(delta) {
        this._gamepads = navigator.getGamepads ? navigator.getGamepads() : (navigator.webkitGetGamepads ? navigator.webkitGetGamepads : []);
        if (this._gamepads != null && this._gamepadsInitialValues == null) {
            this._copyGamePadInitialValues();
        }

        if (this.listenForInputCallbacks != null && this.listenForInputCallbacks.length > 0
            && this._gamepads != null && this._gamepads[0] != null && this._gamepadsInitialValues != null) {
            // check gamepad buttons
            for (var i = 0; i < this._gamepads[0].buttons.length; i++) {
                if (this._gamepads[0].buttons[i].pressed) {
                    for (const callback of this.listenForInputCallbacks) {
                        callback(GF.GAME_CONTROL_TYPE.GAMEPAD_BUTTON, i);
                    }
                    break; 
                }
            }
            // check gamepad axis
            for (var i = 0; i < this._gamepads[0].axes.length; i++) {
                if (Math.round(this._gamepads[0].axes[i]) !== Math.round(this._gamepadsInitialValues[0].axes[i])) {
                    for (const callback of this.listenForInputCallbacks) {
                        callback(GF.GAME_CONTROL_TYPE.GAMEPAD_AXIS, i);
                    }
                    break; 
                }
            }
        }

        for (const keyBind in this._keyBinds) {
            this._currentKeyBind = this._keyBinds[keyBind];
            if (this._currentKeyBind == null || this._currentKeyBind == {}) {
                continue;
            }
            
            // key pressed
            if ((this._currentKeyBind.type === "keyboard" && this.isPressed(keyBind) === true) ||
                (this._currentKeyBind.type === "gamepad" && this.isGamepadButtonPressed(this._currentKeyBind.gamepad, this._currentKeyBind.button) === true)) {
                if (this._currentKeyBind.state === GF.KeyPressState.NONE) {
                    this._currentKeyBind.state = GF.KeyPressState.PRESSED;
                } else if (this._currentKeyBind.state === GF.KeyPressState.PRESSED) {
                    this._currentKeyBind.state = GF.KeyPressState.PRESSING;
                }
            } 
            // key not pressed
            else {
                if (this._currentKeyBind.state === GF.KeyPressState.PRESSING) {
                    this._currentKeyBind.state = GF.KeyPressState.RELEASED;
                } else if (this._currentKeyBind.state === GF.KeyPressState.RELEASED) {
                    this._currentKeyBind.state = GF.KeyPressState.NONE;
                } else if (this._currentKeyBind.state === GF.KeyPressState.PRESSED) {
                    this._currentKeyBind.state = GF.KeyPressState.RELEASED;
                }
            }

            // callbacks
            if (this._currentKeyBind.state != GF.KeyPressState.NONE && this._currentKeyBind[this._currentKeyBind.state] != null) {
                for (let i = 0 ; i < this._currentKeyBind[this._currentKeyBind.state].length; i++) {
                    this._currentKeyBind[this._currentKeyBind.state][i](delta, keyBind);
                }
            }
        }
    }

    /**
     * destroy
     */
    _destroy() {
        if (this._keyBinds) {
            for (var keyBindKey in this._keyBinds) {
                this._keyBinds[keyBindKey] = {
                    state: GF.KeyPressState.NONE,
                    [GF.KeyPressState.PRESSED]: [],
                    [GF.KeyPressState.PRESSING]: [],
                    [GF.KeyPressState.RELEASED]: []
                };
            }
        }
        this._keyboard.destroy();

        if (this._mouseClickCallback != null) {
            document.removeEventListener("click", this._mouseClickCallback, false);
            this._mouseClickCallback = null;
        }
        if (this._mouseDownCallback != null) {
            document.removeEventListener("mousedown", this._mouseDownCallback, false);
            this._mouseDownCallback = null;
        }
        if (this._mouseDownCallback != null) {
            document.removeEventListener("mouseup", this._mouseDownCallback, false);
            this._mouseDownCallback = null;
        }
        if (this._mouseMoveCallback != null) {
            document.removeEventListener("mousemove", this._mouseMoveCallback, false);
            this._mouseMoveCallback = null;
        }

        window.removeEventListener("gamepadconnected", this._gamepadHandlerConnected, false);
        window.removeEventListener("gamepaddisconnected", this._gamepadHandlerDisconnected, false);
    }

    //#endregion
}

/**
 * Utils
 */
GF.Utils = {

    /**
     * Unique id increment
     */
    uniqueIdIncrement: 0,

    /**
     * Generate an unique Id
     */
    uniqueId: function(prefix) {
        this.uniqueIdIncrement++;
        return prefix + (Date.now() + "00" + this.uniqueIdIncrement) + "";  
    },

    /**
     * Converts degrees to radians
     * @param {number} deg degrees
     * @returns radians
     */
    degToRad: function(deg) {
        return deg * (Math.PI / 180);
    },

    /**
     * Converts radians to degrees
     * @param {number} rad radians
     * @returns degrees
     */
    radToDeg: function(rad) {
        return rad / (Math.PI / 180);
    },

    /**
     * Download a file
     * @param {any} data 
     * @param {string} filename 
     * @param {string} type 
     */
    download(data, filename, type) {
        var file = new Blob([data], {type: type});
        if (window.navigator.msSaveOrOpenBlob) // IE10+
            window.navigator.msSaveOrOpenBlob(file, filename);
        else { // Others
            var a = document.createElement("a"),
                    url = URL.createObjectURL(file);
            a.href = url;
            a.download = filename;
            document.body.appendChild(a);
            a.click();
            setTimeout(function() {
                document.body.removeChild(a);
                window.URL.revokeObjectURL(url);  
            }, 0); 
        }
    },

    //#region objects

    /**
     * Build 3D object
     * @param loader the assets loader instance
     * @param {THREE.Object3D | BuildObjectParams} params the actual Object3D or the params to build one
     * #### BuildObjectParams ####
     * * `model: THREE.Geometry | BuildGeometryParams` - The params to build the geometry of the object
     * * `material: THREE.Material | BuildMaterialParams` - The params to build the material of the object
     * * `shadows: {cast: boolean, receive: boolean}` - If the object will cast/receive shadows
     * * `position: Vector3` - Position for the object
     * * `rotation: Vector3` - Rotation for the object
     * * `scale: Vector3` - Scale for the object
     * @returns a new THREE.Mesh
     */
    build3DObject(loader, params) {
        if (params == null) {
            return null;
        }

        var object3D;

        if (params.isObject3D && params.clone != null) {
            object3D = params;
        } else {
            if (typeof(params.mesh) === "string") {
                object3D = loader.get(params.mesh);
            } else if (params.model != null && params.material != null) {
                // process model
                var geometry = params.model.isBufferGeometry ? params.model : this.buildGeometry(loader, params.model);
                
                // process material
                var material = params.material.isMaterial ? params.material : this.buildMaterial(loader, params.material);

                if (geometry != null && material != null) {
                    object3D = new THREE.Mesh(geometry, material);
                }
            } 
            
            if (object3D != null) {
                object3D.castShadow =  params.shadows != null ? params.shadows.cast : false;
                object3D.receiveShadow = params.shadows != null ? params.shadows.receive : false;

                if (params.position) {
                    object3D.position.set(params.position.x, params.position.y, params.position.z)
                }

                if (params.rotation) {
                    object3D.rotation.set(params.rotation.x, params.rotation.y, params.rotation.z)
                }

                if (params.scale) {
                    object3D.scale.set(params.scale.x, params.scale.y, params.scale.z)
                }
            }
        }

        return object3D;
    },

    /**
     * Build Geometry
     * @param loader the assets loader instance
     * @param {string | BuildGeometryParams} params the asset name to load the geometry or the params to build a new geometry
     * #### BuildGeometryParams ####
     * * `type: 'box' | 'sphere' | 'cylinder'` - The type of geometry to build
     * * `size: number` - The size of the geometry (applies only to 'box')
     * * `radius: number` - The radius of the geometry (applies only to 'sphere' or 'cylinder')
     * * `segments: number` - The segments of the geometry (applies only to 'sphere' or 'cylinder')
     * * `height: number` - The height of the geometry (applies only to 'cylinder')
     * @returns a new THREE.Geometry
     */
    buildGeometry(loader, params) {
        // process model
        var geometry = null;
        if (typeof(params) === "string") {
            geometry = loader.get(params);
        } else {
            if (params.type === "box") {
                geometry = new THREE.BoxGeometry(params.size.x, params.size.y, params.size.z);
            } else if (params.type === "sphere") {
                var segments = params.segments != null ? params.segments : 32;
                geometry = new THREE.SphereGeometry(params.radius, segments, segments);
            } else if (params.type === "cylinder") {
                var segments = params.segments != null ? params.segments : 32;
                geometry = new THREE.CylinderGeometry(params.radius, params.radius, params.height, segments);
            } else {
                geometry = new THREE.Geometry();
            }
        }
        
        return geometry;
    },

    /**
     * Build Material
     * @param loader the assets loader instance
     * @param {string | BuildMaterialParams} params the asset name to load the material or the params to build a new material
     * #### BuildMaterialParams ####
     * * `type: 'phong' | 'lambert' | 'toon' | 'basic'` - The type of material to build
     * * `color: number` - The color
     * * `texture: string` - The texture
     * * `specular: number` - The specular color (applicable to 'phong' or 'lambert' only)
     * * `shininess: number` - The specular shininess (applicable to 'phong' or 'lambert' only)
     * * `specularTexture: string` - The specular texture (applicable to 'phong' or 'lambert' only)
     * * `emissiveColor: number` - The emissive color
     * * `emissiveTexture: string` - The emissive texture
     * * `emissiveIntensity: number` - The emissive intensity
     * * `opacity: number` - The opacity (0 - 1)
     * * `reflectionTexture: string` - The reflection texture
     * * `reflectivity: number` - The reflectivity
     * * `reflectivityOperation: number` - The reflectivity operation
     * * `bumpTexture: string` - The bump map texture (applicable to 'phong' only)
     * * `bumpScale: number` - The bump map scale (applicable to 'phong'  only)
     * @returns a new THREE.Material
     */
    buildMaterial(loader, params) {
        var material = null;

        if (typeof(params) === "string") {
            material = loader.get(params);
        } else {
            // use required material if a preset is defined
            var matType = params != null && params.type != null ? params.type : "phong";
            if (loader.gameGraphicsPreset != null && matType !== "basic") {
                if (GF.GRAPHICS_PRESET_PARAMS[loader.gameGraphicsPreset] != null && GF.GRAPHICS_PRESET_PARAMS[loader.gameGraphicsPreset].requiredMaterial) {
                    matType = GF.GRAPHICS_PRESET_PARAMS[loader.gameGraphicsPreset].requiredMaterial
                }
            }

            if (matType === "phong") {
                material = new THREE.MeshPhongMaterial({shininess: 0})
            } else if (matType === "lambert") {
                material = new THREE.MeshLambertMaterial({shininess: 0});
            } else if (matType === "basic") {
                material = new THREE.MeshBasicMaterial();
            } else if (matType === "toon") {
                material = new THREE.MeshToonMaterial();
            } else {
                material = new THREE.MeshBasicMaterial();
            }

            if (params) {
                // color
                material.color = new THREE.Color(params.color != null ? params.color : 0xFFFFFF);

                // emissive color
                if (params.emissiveColor) {
                    material.emissive = new THREE.Color(params.emissiveColor);
                    material.emissiveMap = params.emissiveTexture != null ? loader.get(params.emissiveTexture) : null;
                    material.emissiveIntensity = params.emissiveIntensity != null ? params.emissiveIntensity : 1;
                }

                // texture
                if (params.texture) {
                    material.map = loader.get(params.texture);
                }

                // opacity
                material.opacity = params.opacity != null ? params.opacity : 1;
                if (material.opacity != 1) {
                    material.transparent = true;
                }

                // reflection
                if (params.reflectionTexture) {
                    material.envMap = loader.get(params.reflectionTexture);
                    material.reflectivity = params.reflectivity;
                    if (params.reflectivityOperation) {
                        material.combine = params.reflectivityOperation;
                    }
                }

                // specular
                if (matType === "phong" || matType === "lambert") {
                    material.specular = new THREE.Color(params.specular != null ? params.specular : 0xFFFFFF); 
                    if (params.shininess) {
                        material.shininess = params.shininess;
                    } else {
                        material.shininess = 0;
                    }

                    if (params.specularTexture) {
                        material.specularMap = loader.get(params.specularTexture);
                    }
                }

                // bump
                if (matType === "phong") {
                    if (params.bumpTexture) {
                        material.bumpMap = loader.get(params.bumpTexture);
                        if (params.bumpScale) {
                            material.bumpScale = params.bumpScale;
                        }
                    }
                }
            }
        }

        return material;
    },

    /**
     * Build CollisionVolume from 3D Object
     * @param {THREE.Mesh} object3D 
     * @param {number} sizeMultiplier 
     * @returns 
     */
    buildCollisionVolumeFrom3DObject(object3D, sizeMultiplier) {
        if (object3D != null && object3D.geometry != null) {
            object3D.geometry.computeBoundingBox();
            object3D.geometry.computeBoundingSphere();

            var size = new THREE.Vector3(0,0,0);
            var offset = new THREE.Vector3(0,0,0);

            object3D.geometry.boundingBox.getSize(size);
            object3D.geometry.boundingBox.getCenter(offset);

            if (sizeMultiplier != null) {
                size.multiplyScalar(sizeMultiplier)
            }

            return new GF.CollisionVolume(GF.COLLISION_BOX, [size.x, size.y, size.z], [offset.x, offset.y, offset.z]);
        }
        return null;
    },

    /**
     * Compute global bounding box of an object
     */
    computeGlobalBoundingBox(object) {
        let bbox;
        const resultBbox = new THREE.Box3(new THREE.Vector3(0,0,0), new THREE.Vector3(0,0,0));
        for (const child of object.children) {
            if (child.geometry.computeBoundingBox != null) {
                child.geometry.computeBoundingBox();
                bbox = child.geometry.boundingBox;

                resultBbox.min.min(bbox.min);
                resultBbox.max.max(bbox.max);
            }
        }
        return resultBbox;
    },

    //#endregion

    //#region audio

    /**
     * Build new sound
     * @param {THREE.AudioListener} listener audio listener
     * @param {any} buffer sound buffer
     * @param {any} params params
     * {
     *  positional: boolean (if the sound is positional or global)
     *  loop: boolean,
     *  volume: number (0 - 1)
     *  distance: number (in case of positional=false)
     * }
     */
    newSound(listener, buffer, params) {
        var sound;
        if (!params) {
            params = {};
        }
        // create a global audio source
        if (params.positional) {
            sound = new THREE.PositionalAudio( listener );
            sound.setBuffer( buffer );
            if (params.distance) {
	            sound.setRefDistance( params.distance );
            }
        } else {
            sound = new THREE.Audio( listener );
            sound.setBuffer( buffer );
        }

        if (params.loop) {
            sound.setLoop( params.loop );
        }
        if (params.volume) {
            sound.setVolume( params.volume );
        }
        
        sound.crossOrigin = "anonymous";
        return sound;
    }

    //#endregion
}
/**
 * Default Aspect-ratio values
 */
GF.ASPECT_RATIO = {
    _16_9: 16/9,
    _4_3: 4/3,
    _1_1: 1/1
}

/**
 * Graphics presets
 */
GF.GRAPHICS_PRESET = {
    PS1_Style: "PS1" // PlayStation 1 style
}

/**
 * Graphics presets params 
 */
GF.GRAPHICS_PRESET_PARAMS = {
    [GF.GRAPHICS_PRESET.PS1_Style]: {
        resolution: {
            w: 320,
            h: 240
        },
        requiredMaterial: "lambert",
        imageRendering: "pixelated",
        textures: {
            minFilter: THREE.NearestFilter,
            magFilter: THREE.NearestFilter,
            generateMipmaps: false
        },
        antialias: false,
        precision: "lowp",
        shadowsAllowed: false,
        useOutlineEffect: false
    }
}

// default pages ids
GF.GAME_PAGE = "game";
GF.EDITOR_PAGE = "editor";
GF.LOADING_MODAL = "loading";

/**
 * Create a canvas element inside a container
 * @param {element} container 
 * @param {number} zIndex 
 */
function createCanvas(container, zIndex) {
    const canvas = document.createElement("canvas");
    canvas.style.position = "absolute";
    canvas.style.zIndex = zIndex+"";
    canvas.style.transition = "linear 0.2s filter";

    container.appendChild(canvas);
    return canvas;
}

/**
 * Create container
 * @param {element} container 
 * @param {number} zIndex 
 */
function createContentContainer(container, zIndex) {
    const contentContainer = document.createElement("div");
    contentContainer.style.position = "absolute";
    contentContainer.style.width = "100%";
    contentContainer.style.height = "100%";
    contentContainer.style.zIndex = zIndex+"";
    contentContainer.style.overflow = "hidden";
    container.appendChild(contentContainer);
    return contentContainer;
}

/**
 * Load scripts recursive
 * @param {string[]} list 
 * @param {function} onFinish 
 */
function loadScripsRecursive(list, prefix, onFinish) {
    if (list.length > 0) {
        var file = list.splice(0, 1);

        var s = document.createElement('script');
        s.src = prefix + file + ".js";
        s.type = "text/javascript";
        s.onload = function () {
            loadScripsRecursive(list, prefix, onFinish);
        }
        document.body.appendChild(s);
    } else {
        onFinish();
    }
}

/**
 * Controller (The main class of the framework)
 * It is required to have declared two default pages: LoadingPage and GamePage
 */
GF.GameController = class GameController {
    /**
     * Game Controller (The main class of the framework)
     * @param {string} container the selector of the div where the game will be displayed
     * @param {any | GF.Game} gameParams a class extending GF.Game or params to create a new Game class
     * @param {{name: string, className: string}[]} pages the game pages declaration
     * @param {{objects: string[], pages: string[]}} sourceFilesToLoad the game source .js files to load
     * @param {callback} afterLoad when the game source files are all loaded
     */
    constructor(container, gameParams, pages, sourceFilesToLoad, afterLoad) {
        if (sourceFilesToLoad == null) {
            this._init(container, gameParams, pages, afterLoad);
        } else if (sourceFilesToLoad instanceof Array) {
            loadScripsRecursive(sourceFilesToLoad, "", () => {
                setTimeout(() => {
                    this._init(container, gameParams, pages, afterLoad);
                })
            });            
        } else {
            var sourcePath = sourceFilesToLoad["src"] != null ? sourceFilesToLoad["src"] : "src";

            loadScripsRecursive(sourceFilesToLoad["objects"], sourcePath + "/objects/", () => {
                loadScripsRecursive(sourceFilesToLoad["pages"], sourcePath + "/pages/", () => {
                    setTimeout(() => {
                        this._init(container, gameParams, pages, afterLoad);
                    })
                }); 
            });
        }
    }

    //#region Internal

    /**
     * Init controller 
     */
    _init(container, gameParams, pages, afterLoad) {
        // assets loader
        this.assets = new GF.AssetsLoader();

        this._mainContainer = document.querySelector(container);
        this._mainContainer.style.padding = "0";
        this._mainContainer.style.margin = "0";
        this._mainContainer.style.background = "black";
        this._mainContainer.style.overflow = "hidden";
        this._mainContainer.name = "jgf-main-container";

        // create canvas and containers
        this._container = document.createElement("div");
        this._container.name = "jgf-game-container";
        this._container.style.overflow = "hidden";
        this._container.style.position = "relative";
        this._container.style.marginLeft = "auto";
        this._container.style.marginRight = "auto";
        this._container.style.top = "50%";
        this._container.style.transform = "translateY(-50%)";
        this._gameCanvas = createCanvas(this._container, 2);
        this._gameDebugCanvas = createCanvas(this._container, 3);
        this._pageContainer = createContentContainer(this._container, 4);
        this._modalContainer = createContentContainer(this._container, 6);
        this._modalContainer.style.display = "none";
        this._mainContainer.appendChild(this._container);

        // game
        if (typeof(gameParams) === "string") {
            this.game = window.eval.call(window, `(function (canvas, debugCanvas, loader) { return new ${gameParams}(canvas, debugCanvas, loader) })`)(this._gameCanvas, this._gameDebugCanvas, this.assets);
        } else {
            this.game = new GF.Game(this._gameCanvas, this._gameDebugCanvas, this.assets, gameParams.params, gameParams.onStart, gameParams.onUpdate, gameParams.onStop, gameParams.onTickUpdate, gameParams.onPointerLockChange);
        }
        this.game._mainContainer = this._container;

        // aspect ratio
        this._aspectRatio = this.game._aspectRatio != null ? this.game._aspectRatio : GF.ASPECT_RATIO._16_9;

        // preset
        if (this.game._graphicsPreset) {
            this.assets.setGraphicsPreset(this.game._graphicsPreset);
            if (GF.GRAPHICS_PRESET_PARAMS[this.game._graphicsPreset]) {
                this._gameCanvas.style.imageRendering = GF.GRAPHICS_PRESET_PARAMS[this.game._graphicsPreset].imageRendering;
            }
        }

        // page manager
        this.pages = new GF.PageManager(this._pageContainer, this._modalContainer);
        this.game._pages = this.pages;

        // add pages
        if (pages) {
            for (const page of pages) {
                this.pages.addPage(page.name, window.eval.call(window, `(function (controller) { return new ${page.className}(controller) })`)(this));
            }
        }

        // add default required pages
        if (this.pages.getPage(GF.GAME_PAGE) == null) {
            this.pages.addPage(GF.GAME_PAGE, new DefaultGamePage(this));
        }
        if (this.pages.getPage(GF.LOADING_MODAL) == null) {
            this.pages.addPage(GF.LOADING_MODAL, new DefaultLoadingPage(this));
        }
        this.pages.addPage(GF.EDITOR_PAGE, new EditorPage(this));

        // bind to window resize
        this.onWindowResizeCallback = this.onWindowResize.bind(this);
        window.addEventListener('resize', this.onWindowResizeCallback);

        this.onWindowResize();

        // https://greensock.com/forums/topic/10051-animations-pause-when-browser-tab-is-not-visible/
        // window focus event listeners to pause animations
        var self = this;
        // check if browser window has focus		
        var notIE = (document.documentMode === undefined),
        isChromium = window.chrome;

        if (notIE && !isChromium) {
            // checks for Firefox and other  NON IE Chrome versions
            window.addEventListener("focusin", function () { 
                self.resume();
            }, false);

            window.addEventListener("focusout", function () { 
                self.pause();
            }, false);
        } else {
            // checks for IE and Chromium versions
            if (window.addEventListener) {

                // bind focus event
                window.addEventListener("focus", function (event) {
                    self.resume();
                }, false);

                // bind blur event
                window.addEventListener("blur", function (event) {
                    self.pause();
                }, false);

            } else {

                // bind focus event
                window.attachEvent("focus", function (event) {
                    self.resume();
                });

                // bind focus event
                window.attachEvent("blur", function (event) {
                    self.pause();
                });
            }
        }

        if (afterLoad) {
            afterLoad();
        }
    }

    //#endregion

    //#region API

    /**
     * Go to page
     */
    gotToPage(page) {
        this.pages.goTo(page);
    }

    /**
     * Boot Game
     * 
     * @param type the boot type
     * @param params the boot params
     * 
     * type = 'default':
     *   1 - load currently added assets
     *   2 - Go to game page
     */
    boot(type, params, afterBoot) {
        if (type === "default") {
            this.loadAllAssets(() => {
                if (afterBoot) {
                    afterBoot();
                }
                this.pages.goTo(GF.GAME_PAGE);
            })
        } else if (type === "default-no-assets") {
            if (afterBoot) {
                afterBoot();
            }
            this.pages.goTo(GF.GAME_PAGE);
        } else if (type === "editor") {
            this.loadAllAssets(() => {
                this.pages.goTo(GF.EDITOR_PAGE, params);
            });
        }
    }

    /**
     * Resume
     */
    resume() {
        this.game.resume();
        this.pages.resumeAnimation();
    }

    /**
     * Pause
     */
    pause() {
        this.game.pause();
        this.pages.pauseAnimation();
    }
    
    /**
     * On window resize (must be called whenever the container div changes its size)
     */
    onWindowResize() {
        var width, height;

        width = this._mainContainer.offsetHeight * this._aspectRatio;
        height = this._mainContainer.offsetHeight;

        if (width > this._mainContainer.offsetWidth) {
            width = this._mainContainer.offsetWidth;
            height = (1 / this._aspectRatio) * this._mainContainer.offsetWidth;
        }

        // update game canvas
        this._container.style.width = width + "px";
        this._container.style.height = height + "px";
        this.game.onContainerResize(width, height);

        // notify pages of  window resize
        this.pages.onContainerResize(width, height);
    }

    /**
     * Add asset to load
     * @param {string} name the asset name
     * @param {AssetType} type the asset type
     * @param {string | object} params the path for the file, or a group of params in certain cases
     */
    addAsset(name, type, params) {
        this.assets.add(name, type, params)
    }

    /**
     * Add preloaded asset
     * @param {string} name the asset name
     * @param {AssetType} type the asset type
     * @param {object} content the asset
     */
    addPreloadedAsset(name, type, content) {
        this.assets.addPreloaded(name, type, content)
    }

    /**
     * Load all assets (only the ones that are not loaded yet)
     * @param {function} callback callback when loading is finished
     * @param {boolean} showLoadingModal if the loading modal is to be shown while loading
     */
    loadAllAssets(callback, showLoadingModal = true) {
        if (showLoadingModal) {
            this.pages.openModal(GF.LOADING_MODAL);
        }
        this.assets.loadAll((progress) => {
            if (showLoadingModal) {
                // update
                this.pages.getPage(GF.LOADING_MODAL).updateProgress(progress);
            }
        },
        () => {
            if (typeof(callback) === "function") {
                const callbackResult = callback();
                if (showLoadingModal) {
                    if (callbackResult != null && typeof(callbackResult.then) === "function") {
                        callbackResult.then((result) => {
                            if (result == null || result === true) {
                                this.pages.closeModal();
                            }
                        });
                    } else {
                        if (callbackResult == null || callbackResult === true) {
                            this.pages.closeModal();
                        }
                    }
                }
            } else {
                if (showLoadingModal) {
                    this.pages.closeModal();
                }
            }
        },
        () => {
            // error
        });
    }

    /**
     * Add new custom asset loader 
     * @param {string} typeName the loader type name
     * @param {string} loaderClass name of a class that extends GF.FileLoader
     */
    addCustomAssetLoader(typeName, loaderClass) {
        this.assets.addCustomAssetLoader(typeName, loaderClass);
    }

    /**
     * Destroy
     */
    destroy() {
        window.removeEventListener('resize', this.onWindowResizeCallback);
    }

    //#endregion
}


/**
 * PageManager
 */
GF.PageManager = class PageManager {
    /**
     * PageManager
     * @param {HTMLElement} pageContainer page container element
     * @param {HTMLElement} modalContainer modal container element
     */
    constructor(pageContainer, modalContainer) {
        this._pages = {};
        this._pageContainer = pageContainer;
        this._modalContainer = modalContainer;
        this._currentPage = null;
        this._currentModal = null;
        this._navigating = false;

        this._animateCallback = this._animate.bind(this);
        this.resumeAnimation();
    }

    //#region API

    /**
     * Add a page
     * @param {string} id page id
     * @param {Page} page the oage
     */
    addPage(id, page) {
        page.pageId = id;
        this._pages[id] = page;
    }

    /**
     * Remove a page
     * @param {srtring} id page id
     */
    removePage(id) {
        this._pages[id] = undefined;
    }

    /**
     * Get page
     * @param {string} id page id
     */
    getPage(id) {
        return this._pages[id];
    }

    /**
     * Go to page
     * @param {string} id page id
     * @param {any} args arguments (optional)
     */
    goTo(id, args) {
        if (!this._navigating && this._currentPage !== this._pages[id]) {
            let closePromise = Promise.resolve();
            if (this._currentPage != null) {
                closePromise = this._currentPage._close();
                if (closePromise == null) {
                    closePromise = Promise.resolve();
                }
            }
            this._navigating = true;
            closePromise.then(() => {
                this._currentPage = this._pages[id];
                const openPromise = this._currentPage._open(this._pageContainer, args);
                if (openPromise != null) {
                    openPromise.then(() => {
                        this._navigating = false;
                    });
                } else {
                    this._navigating = false;
                }
            });
        }
    }

    /**
     * Open modal
     * @param {string} id page id 
     */
    openModal(id) {
        if (this._currentModal !== this._pages[id]) {
            let closePromise = Promise.resolve();
            if (this._currentModal != null) {
                closePromise = this._currentModal._close();
            }
            closePromise.then(() => {
                this._currentModal = this._pages[id];
                if (this._currentModal != null) {
                    this._modalContainer.style.display = "initial";
                    this._currentModal._open(this._modalContainer);
                }
            });
        }
    }

    /**
     * Close modal
     */
    closeModal() {
        if (this._currentModal != null) {
            let promise = this._currentModal._close();
            this._modalContainer.style.display = "none";
            
            if (promise != null) {
                promise.then(() => {
                    this._currentModal = null;
                });
            } else {
                this._currentModal = null;
            }
        }
    }

    /**
     * Resume the animation
     */
    resumeAnimation() {
        this._running = true;
        this._lastTime = new Date().valueOf();
        this._animateCallback();
    }

    /**
     * Pause the animation
     */
    pauseAnimation() {
        if (this._animationFrameRequest) {
            cancelAnimationFrame(this._animationFrameRequest);
        }
        this._running = false;
    }

    /**
     * When main container is resized
     * @param {number} width 
     * @param {number} height 
     */
    onContainerResize(width, height) {
        if (this._currentPage != null) {
            this._currentPage._resize(width, height);
        }
        if (this._currentModal != null) {
            this._currentModal._resize(width, height);
        }
    }

    //#endregion

    //#region Internal

    /**
     * Animate
     */
    _animate() {
        if (this._running === true) {
            // calculate delta
            var now = new Date().valueOf();
            var delta = (now - this._lastTime) * 0.001;
            this._lastTime = now;

            if (this._currentModal != null) {
                this._currentModal._update(delta);
            } else if (this._currentPage != null) {
                this._currentPage._update(delta);
            }

            this._animationFrameRequest = requestAnimationFrame(this._animateCallback);
        }
    }

    _destroy() {
        this.pauseAnimation();
    }

    //#endregion
}
/**
 * Base UI Page
 */
GF.Page = class Page {
    /**
     * Constructor
     * @param {{useCanvas: boolean, background: string, style: string, html: string}} properties 
     * @param {GF.GameController} controller
     */
    constructor(properties, controller) {
        this.contentDiv = document.createElement("div");
        this.contentDiv.style.position = "relative";
        this.contentDiv.style.width = "100%";
        this.contentDiv.style.height = "100%";
        this.contentDiv.style.overflow = "hidden";
        this.controller = controller;

        this.content = $(this.contentDiv);

        this._PAGE_CANVAS_SHAPE_TYPE = {
            Image: 1,
            Text: 2,
            Square: 3,
            Line: 4,
        }

        this._canvasShapes = {};
        this._canvasShapeDrawArray = [];

        if (properties) {
            this._useCanvas = properties.useCanvas;

            this.contentDiv.style.background = properties.background;

            var name = properties.name != null ? properties.name : "test";

            if (name != null && properties.style != null) {
                this.addStyle(name, properties.style)
            }

            if (this._useCanvas) {
                this._canvasHTMLElement = document.createElement("canvas");
                this._canvasHTMLElement.style.position = "absolute";
                this._canvasHTMLElement.style.zIndex = "100";
                this._canvasHTMLElement.width = this.contentDiv.offsetWidth;
                this._canvasHTMLElement.height = this.contentDiv.offsetHeight;
                this.context2D = this._canvasHTMLElement.getContext("2d");
                this.contentDiv.appendChild(this._canvasHTMLElement);

                this.canvas = {
                    "createShapeImage": this._addImageShape.bind(this),
                    "createShapeText": this._addTextShape.bind(this),
                    "createShapeSquare": this._addSquareShape.bind(this),
                    "createShapeLine": this._addLineShape.bind(this)
                }
            } else if (properties.html) {
                this.contentDiv.innerHTML = properties.html;

                var children = this.contentDiv.querySelectorAll("[id]");
                for (var child of children) {
                    this[child.id] = this.content.find(child);
                }
            }
        }
    }

    //#region internal

    /**
     * Open page
     */
    _open(container, args) {
        this.container = container;
        this.container.innerHTML = "";
        this.container.appendChild(this.contentDiv);
        if (this._useCanvas) {
            this.redrawCanvas();
        }
        return this.onOpen(args);
    }

    /**
     * Close page
     */
    _close() {
        this.container.innerHTML = "";
        this.container = null;
        this._removeAllShapes();
        return this.onClose();
    }

    /**
     * Update page
     */
    _update(delta) {
        this.onUpdate(delta);
    }

    /**
     * When main container is resized
     * @param {number} width 
     * @param {number} height 
     */
    _resize(width, height) {
        if (this._canvasHTMLElement) {
            this.redrawCanvas();
        }
    }

    /**
     * Sanitize coordinate
     * @param {*} coordinate 
     */
    _sanitizeCoordinate(coordinate) {
        coordinate = Number(coordinate);
        if (!isNaN(coordinate)) {
            return coordinate < 0 ? 0 : (coordinate > 100 ? 100 : coordinate)
        } else {
            return 0;
        }
    }

    /**
     * Sanitize size
     * @param {*} size 
     */
    _sanitizeSize(size) {
        size = Number(size)
        if (!isNaN(size)) {
            return size < 0.01 ? 0.01 : (size > 100 ? 100 : size);
        } else {
            return 0.01;
        }
    }

    /**
     * Sanitize algin
     * @param {*} algin 
     */
    _sanitizeAlign(align) {
        var result;
        if (typeof(align) !== "string") {
            result = "left-top-corner"
        } else {
            result = align.toLowerCase();

            if (result !== "left-top-corner"
            && result !== "left-bottom-corner"
            && result !== "right-top-corner"
            && result !== "right-bottom-corner"
            && result !== "center") {
                result = "left-top-corner";
            }
        }
        return result;
    }

    /**
     * Update draw array
     */
    _updateDrawArray() {
        this._canvasShapeDrawArray = this._canvasShapeDrawArray.sort((a, b) => {
            return a.zIndex > b.zIndex ? 1 : (a.zIndex < b.zIndex ? -1 : 0)
        })
    }

    /**
     * Add a new shape
     * @param {string} id 
     * @param {any} shape 
     */
    _addShape(id, shape, zIndex = 0) {
        if (this._canvasShapes[id] == null) {
            this._canvasShapes[id] = shape;
            this._canvasShapes[id].zIndex = zIndex;

            this._canvasShapeDrawArray.push(this._canvasShapes[id]);
            this._updateDrawArray();

            this.redrawCanvas();

            return {
                "remove": () => {
                    this._removeShape(id);
                },
                "setProperty": (property, value) => {
                    this._editShapeProperty(id, property, value);
                },
                "setVisible": (visible) => {
                    this._setShapeVisible(id, visible);
                },
            }
        } else {
            console.error("trying to add two shapes with Id: " + id)
        }
    }

    /**
     * Add Image to Canvas UI
     * @param {string} id shape id
     * @param {string} image image asset
     * @param {number} x image x
     * @param {number} y image y
     * @param {number} width image width
     * @param {number} height image height
     * @param {string} align image align: 'left-top-corner' (default) or 'center'
     */
    _addImageShape(id, image, x, y, width, height, align, zIndex = 0) {
        const img = this.controller.assets.get(image);

        if (img != null) {
            var shape = this._addShape(id, {
                type: this._PAGE_CANVAS_SHAPE_TYPE.Image,
                visible: true,
                loaded: true,
                opacity: 1,
                img: img,
                aspectRatio: img.height / img.width,
                x: this._sanitizeCoordinate(x),
                y: this._sanitizeCoordinate(y),
                width: width,
                height: height,
                align: this._sanitizeAlign(align),
            }, zIndex);

            return shape;
        } else {
            return null;
        }
    }

    /**
     * Add Text to Canvas UI
     * @param {string} id shape id
     * @param {string} text the text
     * @param {number} x text x (% of the screen)
     * @param {number} y text y (% of the screen)
     * @param {string} color text color
     * @param {string} font text font
     * @param {number} size text size (% of screen height)
     * @param {string} style text style
     * @param {string} baseline text baseline
     * @param {string} align text align
     */
    _addTextShape(id, text, x, y, color, font, size, style, baseline, align, zIndex = 0) {
        return this._addShape(id, {
            type: this._PAGE_CANVAS_SHAPE_TYPE.Text,
            visible: true,
            text: text != null ? text : "no text",
            x: this._sanitizeCoordinate(x),
            y: this._sanitizeCoordinate(y),
            color: color != null ? color : "white",
            font: font != null ? font : "Arial",
            size: size != null ? size : 1,
            style: style != null ? style : "normal",
            baseline: baseline != null ? baseline : "middle",
            align: align != null ? align : "left",
        }, zIndex);
    }

    /**
     * Add Square shape to Canvas UI
     * @param {string} id shape id
     * @param {number} x square x (% of the screen)
     * @param {number} y square y (% of the screen)
     * @param {number} width square width (% of the screen)
     * @param {number} height square height (% of the screen)
     * @param {string} color square background color
     * @param {string} borderColor square border color
     * @param {number} borderWidth square border width (% of the screen)
     * @param {string} align square align: 'left-top-corner' (default) or 'center'
     */
    _addSquareShape(id, x, y, width, height, color, borderColor, borderWidth, align, zIndex = 0) {
        return this._addShape(id, {
            type: this._PAGE_CANVAS_SHAPE_TYPE.Square,
            visible: true,
            x: this._sanitizeCoordinate(x),
            y: this._sanitizeCoordinate(y),
            width: this._sanitizeSize(width),
            height: this._sanitizeSize(height),
            color: color != null ? color : null,
            borderColor: borderColor != null ? borderColor : "transparent",
            borderWidth: borderWidth != null ? borderWidth : 0,
            align: this._sanitizeAlign(align),
        }, zIndex);
    }

    /**
     * Add Line shape to Canvas UI
     * @param {string} id shape id
     * @param {number} x1 line start x (% of the screen)
     * @param {number} y1 line start y (% of the screen)
     * @param {number} x2 line end x (% of the screen)
     * @param {number} y2 line end y (% of the screen)
     * @param {string} color line color
     * @param {number} width line width (% of the screen)
     */
    _addLineShape(id, x1, y1, x2, y2, color, width, zIndex = 0) {
        return this._addShape(id, {
            type: this._PAGE_CANVAS_SHAPE_TYPE.Line,
            visible: true,
            x1: this._sanitizeCoordinate(x1),
            y1: this._sanitizeCoordinate(y1),
            x2: this._sanitizeCoordinate(x2),
            y2: this._sanitizeCoordinate(y2),
            color: color != null ? color : "transparent",
            width: width != null ? width : 1
        }, zIndex);
    }

    /**
     * Remove canvas shape
     * @param {string} id 
     */
    _removeShape(id) {
        const index = this._canvasShapeDrawArray.indexOf(this._canvasShapes[id]);
        if (index >= 0) {
            this._canvasShapeDrawArray.splice(index, 1);
            this._updateDrawArray();
        }
        this._canvasShapes[id] = undefined;
    }

    /**
     * Remove all shapes
     */
    _removeAllShapes() {
        this._canvasShapeDrawArray = [];
        this._updateDrawArray();
        this._canvasShapes = {};
    }

    /**
     * Edit canvas shape property
     * @param {string} id 
     * @param {string} property 
     * @param {any} value
     */
    _editShapeProperty(id, property, value) {
        if (this._canvasShapes[id]) {
            this._canvasShapes[id][property] = value;
            this.redrawCanvas();
        }
    }

    /**
     * Set canvas shape visible
     * @param {boolean} visible 
     */
    _setShapeVisible(id, visible) {
        if (this._canvasShapes[id]) {
            this._canvasShapes[id].visible = visible;
            this.redrawCanvas();
        }
    }

    /**
     * Process alignment
     * @param {string} align alignment
     * @param {number} x x
     * @param {number} y y
     * @param {number} width width
     * @param {number} height height
     */
    _processAlignment(align, x, y, width, height) {
        if (align === "center") {
            this.currentDrawShapeX = x - (width * 0.5);
            this.currentDrawShapeY = y - (height * 0.5);
        } else if (align === "left-top-corner") {
            this.currentDrawShapeX = x;
            this.currentDrawShapeY = y;
        } else if (align === "right-top-corner") {
            this.currentDrawShapeX = x - width;
            this.currentDrawShapeY = y;
        } else if (align === "left-bottom-corner") {
            this.currentDrawShapeX = x;
            this.currentDrawShapeY = y - height;
        } else if (align === "right-bottom-corner") {
            this.currentDrawShapeX = x - width;
            this.currentDrawShapeY = y - height;
        }
    }

    //#endregion

    //#region API

    /**
     * Add style to html
     * @param {string} styleContentText 
     */
    addStyle(id, styleContentText) {
        var formattedId = "page-style-" + id;
        if (!document.getElementById(formattedId)) {
            var style = document.createElement('style');
            style.type = 'text/css';
            style.innerHTML = styleContentText;
            style.id = formattedId;
            document.getElementsByTagName('head')[0].appendChild(style);
        }
    }

    /**
     * Function to redraw canvas
     * (automatically called on resize)
     */
    redrawCanvas() {
        this._canvasHTMLElement.width = this.contentDiv.offsetWidth;
        this._canvasHTMLElement.height = this.contentDiv.offsetHeight;
        this._canvasWidth = this.contentDiv.offsetWidth;
        this._canvasHeight = this.contentDiv.offsetHeight;
        
        this.context2D.clearRect(0, 0, this._canvasWidth, this._canvasHeight);

        for (var i = 0; i < this._canvasShapeDrawArray.length; i++ ) {
            if (this._canvasShapeDrawArray[i].visible) {

                this.context2D.globalAlpha = this._canvasShapeDrawArray[i].opacity;

                if (this._canvasShapeDrawArray[i].shadow != null) {
                    this.context2D.shadowColor = 'rgba(0, 0, 0, 0.75)';
                    this.context2D.shadowBlur = this._canvasShapeDrawArray[i].shadow;
                }

                this.context2D.filter = this._canvasShapeDrawArray[i].filter != null ? this._canvasShapeDrawArray[i].filter : "none";

                switch(this._canvasShapeDrawArray[i].type) {
                    case this._PAGE_CANVAS_SHAPE_TYPE.Image: // image
                    case this._PAGE_CANVAS_SHAPE_TYPE.Square: // square
                        // square
                        if (this._canvasShapeDrawArray[i].type === this._PAGE_CANVAS_SHAPE_TYPE.Square) {
                            // process alignment
                            this._processAlignment(
                                this._canvasShapeDrawArray[i].align,
                                this._canvasShapeDrawArray[i].x,
                                this._canvasShapeDrawArray[i].y,
                                this._canvasShapeDrawArray[i].width,
                                this._canvasShapeDrawArray[i].height)

                            // fill
                            if (this._canvasShapeDrawArray[i].color != null) {
                                this.context2D.fillStyle = this._canvasShapeDrawArray[i].color;
                                this.context2D.fillRect(
                                    (this.currentDrawShapeX / 100) * this._canvasWidth,
                                    (this.currentDrawShapeY / 100) * this._canvasHeight,
                                    (this._canvasShapeDrawArray[i].width / 100) * this._canvasWidth,
                                    (this._canvasShapeDrawArray[i].height / 100) * this._canvasHeight
                                );
                            }

                            // stroke
                            if (this._canvasShapeDrawArray[i].borderColor != null) {
                                this.context2D.strokeStyle = this._canvasShapeDrawArray[i].borderColor;
                                this.context2D.lineWidth = (this._canvasShapeDrawArray[i].borderWidth / 100) * this._canvasHeight;
                                this.context2D.strokeRect(
                                    (this.currentDrawShapeX / 100) * this._canvasWidth,
                                    (this.currentDrawShapeY / 100) * this._canvasHeight,
                                    (this._canvasShapeDrawArray[i].width / 100) * this._canvasWidth,
                                    (this._canvasShapeDrawArray[i].height / 100) * this._canvasHeight
                                );
                            }
                        
                        // image
                        } else {
                            // width & height specified
                            if (this._canvasShapeDrawArray[i].width != null && this._canvasShapeDrawArray[i].height != null) {
                                this.imgWidth = this._canvasShapeDrawArray[i].width;
                                this.imgHeight = this._canvasShapeDrawArray[i].height;
                            // only width specified
                            } else if (this._canvasShapeDrawArray[i].height == null) {
                                this.imgWidth = this._canvasShapeDrawArray[i].width;
                                this.imgHeight = this.imgWidth * this._canvasShapeDrawArray[i].aspectRatio;
                                this.canvasDimension = this._canvasWidth;
                            // only height specified
                            } else if (this._canvasShapeDrawArray[i].width == null) {
                                this.imgHeight = this._canvasShapeDrawArray[i].height;
                                this.imgWidth = this.imgHeight / this._canvasShapeDrawArray[i].aspectRatio;
                                this.canvasDimension = this._canvasHeight;
                            }

                            this.imgWidth = (this.imgWidth / 100) *  (this.canvasDimension != null ? this.canvasDimension : this._canvasWidth);
                            this.imgHeight = (this.imgHeight / 100) * (this.canvasDimension != null ? this.canvasDimension : this._canvasHeight);

                            // process alignment
                            this._processAlignment(
                                this._canvasShapeDrawArray[i].align,
                                (this._canvasShapeDrawArray[i].x / 100) * this._canvasWidth,
                                (this._canvasShapeDrawArray[i].y / 100) * this._canvasHeight,
                                this.imgWidth,
                                this.imgHeight);

                            

                            // draw
                            this.context2D.drawImage(
                                this._canvasShapeDrawArray[i].img,
                                this.currentDrawShapeX,
                                this.currentDrawShapeY,
                                this.imgWidth,
                                this.imgHeight
                            );
                        }
                        break;
                    case this._PAGE_CANVAS_SHAPE_TYPE.Text: // text
                        this.context2D.fillStyle = this._canvasShapeDrawArray[i].color;
                        this.context2D.textBaseline = this._canvasShapeDrawArray[i].baseline;
                        this.context2D.textAlign = this._canvasShapeDrawArray[i].align;
                        this.context2D.font = this._canvasShapeDrawArray[i].style + " " + ((this._canvasShapeDrawArray[i].size / 100) * this._canvasHeight) + "px " + this._canvasShapeDrawArray[i].font;
                        this.context2D.fillText(
                            this._canvasShapeDrawArray[i].text,
                            (this._canvasShapeDrawArray[i].x / 100) * this._canvasWidth,
                            (this._canvasShapeDrawArray[i].y / 100) * this._canvasHeight
                        );
                        break;
                    case this._PAGE_CANVAS_SHAPE_TYPE.Line: // line
                        this.context2D.strokeStyle = this._canvasShapeDrawArray[i].color;
                        this.context2D.lineWidth = (this._canvasShapeDrawArray[i].width / 100) * this._canvasHeight;
                        this.context2D.strokeLine(
                            (this._canvasShapeDrawArray[i].x1 / 100) * this._canvasWidth,
                            (this._canvasShapeDrawArray[i].y1 / 100) * this._canvasHeight,
                            (this._canvasShapeDrawArray[i].x2 / 100) * this._canvasWidth,
                            (this._canvasShapeDrawArray[i].y2 / 100) * this._canvasHeight
                        );
                        break;
                }

                // reset
                this.context2D.shadowColor = null;
                this.context2D.shadowBlur = null;
                this.context2D.filter = "none";
                this.context2D.globalAlpha = 1;
            }
        }

        // custom draw
        this.onCanvasDraw();
    }
    
    //#endregion

    //#region abstract

    /**
     * On canvas draw custom code
     * (To override if needed)
     */
    onCanvasDraw() {
    }

    /**
     * On page open
     * @param {any} args 
     * @returns 
     */
    onOpen(args) {return Promise.resolve()}

    /**
     * On page close
     * @returns 
     */
    onClose() {return Promise.resolve()}

    /**
     * On page update
     * @param {number} delta 
     */
    onUpdate(delta) {}

    //#endregion
}


