/**
 * TextureAnimator
 */
GF.TextureAnimator = class TextureAnimator {
    /**
     * TextureAnimator
     * @param {THREE.Texture} texture
     * @param {number} tilesHorizontal number of horizontal tiles
     * @param {number} tilesVertical number of vertical tiles
     * @param {number} numTiles number of tiles
     * @param {number} tileDisplayDuration tiles display duration
     */
    constructor(texture, tilesHorizontal, tilesVertical, numTiles, tileDisplayDuration) {	           
        this._tilesHorizontal = tilesHorizontal;
        this._tilesVertical = tilesVertical;
        this._numberOfTiles = numTiles;
        this._texture = texture;
        this._texture.wrapS = texture.wrapT = THREE.RepeatWrapping; 
        this._texture.repeat.set( 1 / this._tilesHorizontal, 1 / this._tilesVertical );
    
        // how much time each image is displayed
        this._tileDisplayDuration = tileDisplayDuration;
    
        // current display time of the current image
        this._currentDisplayTime = 0;
    
        // current image being displayed
        this._currentTile = 0;

        this._running = false;
    }

    /**
     * Play
     */
    play() {
        this._running = true;
        this._currentDisplayTime = 0;
    }

    /**
     * Stop
     */
    stop() {
        this._running = false;
    }

    /**
     * Update
     * @param {number} delta
     */
    update(delta) {
        if (this._running) {
            this._currentDisplayTime += delta;
            while (this._currentDisplayTime > this._tileDisplayDuration)
            {
                this._currentDisplayTime -= this._tileDisplayDuration;
                this._currentTile++;

                if (this._currentTile === this._numberOfTiles)
                    this._currentTile = 0;
        
                this._texture.offset.x = (this._currentTile % this._tilesHorizontal) / this._tilesHorizontal;
                this._texture.offset.y = Math.floor( this._currentTile / this._tilesHorizontal ) / this._tilesVertical;
            }
        }
    }
}

/**
 * Scene
 */
 GF.Scene = class Scene {
    /**
     * Create a template scene from an asset JSON file
     * @param {GF.Game} game the game instance pointer
     * @param {string} sceneAsset the asset of the scene file
     * @param {'three' | 'jgf'} sceneType the scene type (if is a file produced in Three.gf editor it should be 'jgf' instead if
     * it is produced by THREEjs json file it should be 'three')
     */
    constructor(game, sceneAsset, sceneType) {	     
        this._game = game;      
        this._sceneAsset = sceneAsset;
        this._sceneType = sceneType != null ? sceneType : "jgf";
    }

    /**
     * Instantiate object
     */
    _instantiateObject(id, type, args) {
        var newObject, constructorString, argumentNames;
        // arguments
        constructorString = `new ${type}(`;
        if (args instanceof Array) {
            for (var i = 0; i<args.length; i++) {
                constructorString += JSON.stringify(args[i]);
                if (i < args.length-1) {
                    constructorString += ",";
                }
            }
        } else {
            constructorString += JSON.stringify(args);
        }
        constructorString += `)`;

        try {
            newObject = eval(constructorString);
        } catch(ex) {
            console.error(ex);
            newObject = null;
        }

        if (newObject != null) {
            this._game.addObject(id, newObject);
        }

        return newObject;
    }

    /**
     * Init scene for a ThreeJs JSON file
     */
    _initForThreeJsScene() {
        if (this.sceneAssetData != null && this.sceneAssetData.object != null && this.sceneAssetData.object.children != null && this.sceneAssetData.object.type === "Scene") {
            var children = this.sceneAssetData.object.children;
            var newObject, light, matrix, newMesh, geometry, material, mat, cv, position, quaternion, scale;
            for (var i = 0; i < children.length; i++) {
                matrix = new THREE.Matrix4();
                matrix.fromArray(children[i].matrix);

                position = new THREE.Vector3();
                quaternion = new THREE.Quaternion();
                scale = new THREE.Vector3();
                matrix.decompose(position, quaternion, scale)

                // Collision volume
                if (children[i].name === "CollisionBox") {
                    cv = this._game.physics.addVolume(null,
                        new GF.CollisionVolumeBox(scale.x, scale.y, scale.z, new THREE.Vector3(0,0,0)),
                        position
                    );

                    this.collisionVolumes.push(cv);
                }
                // Object
                else if (children[i].type === "Mesh") {
                    if (children[i].userData != null) {
                        // Mesh
                        if (children[i].name === "Mesh") {
                            // create geometry
                            geometry = this._game.loader.get(children[i].userData.model);

                            // create material
                            mat = this.sceneAssetData.materials != null ? this.sceneAssetData.materials.find(m => m.uuid === children[i].material) : null;
                            if (mat != null) {
                                material = GF.Utils.buildMaterial(
                                    this._game.loader,
                                    {
                                        texture: children[i].userData.map,
                                        bumpTexture: children[i].userData.bumpMap,
                                        specularTexture: children[i].userData.specularMap,
                                        alphaTexture: children[i].userData.alphaMap,
                                        emissiveTexture: children[i].userData.emissiveMap,
                                        color: mat.color,
                                        shininess: mat.shininess,
                                        emissiveColor: mat.emissive,
                                        specular: mat.specular,
                                        bumpScale: mat.bumpScale,
                                        opacity: mat.opacity
                                    }
                                );
                            }

                            newMesh = new THREE.Mesh(geometry, material);
                            newMesh.castShadow = children[i].castShadow;
                            newMesh.receiveShadow = children[i].receiveShadow;

                            newMesh.position.copy(position);
                            newMesh.rotation.setFromQuaternion(quaternion);
                            newMesh.scale.copy(scale);

                            this.sceneObjects.push(newMesh);
                            this._game.addToScene(newMesh);
                        }
                        // GameObject
                        else {
                            newObject = this._instantiateObject(children[i].uuid, children[i].name, children[i].userData);
                            newObject.subscribeOnInit(function() {
                                if (newObject.object3D != null) {
                                    newObject.object3D.position.copy(position);
                                    newObject.object3D.rotation.setFromQuaternion(quaternion);
                                    newObject.object3D.scale.copy(scale);
                                }
                            });
                            this.objects.push(newObject);
                        }
                    }
                }
                // PointLight
                else if (children[i].type === "PointLight") {
                    light = new THREE.PointLight(children[i].color, children[i].intensity, children[i].distance, children[i].decay);
                    light.castShadow = children[i].castShadow;
                    light.name = children[i].name;
                    if (children[i].shadow && children[i].shadow.camera) {
                        light.shadow.camera.type = children[i].shadow.camera.type;
                        light.shadow.camera.fov = children[i].shadow.camera.fov;
                        light.shadow.camera.zoom = children[i].shadow.camera.zoom;
                        light.shadow.camera.near = children[i].shadow.camera.near;
                        light.shadow.camera.far = children[i].shadow.camera.far;
                    }

                    light.position.copy(position);
                    light.rotation.setFromQuaternion(quaternion);
                    light.scale.copy(scale);

                    this.sceneObjects.push(light);
                    this._game.addToScene(light);
                }
                // HemisphereLight
                else if (children[i].type === "HemisphereLight") {
                    light = new THREE.HemisphereLight(children[i].color, children[i].groundColor, children[i].intensity);
                    this.sceneObjects.push(light);
                    this._game.addToScene(light);
                }
            } 
        }
    }

    /**
     * Init scene for a file of Three.gf editor
     */
    _initForJGFScene() {
        var newObject;
        if (this.sceneAssetData.objects instanceof Array) {
            for (const object of this.sceneAssetData.objects) {
                // game object
                if (object.gameObject) {

                    for (const index in object.params) {
                        if (object.params[index] === "{{position}}") {
                            object.params[index] = object.position;
                        } else if (object.params[index] === "{{rotation}}") {
                            object.params[index] = object.rotation;
                        } else if (object.params[index] === "{{scale}}") {
                            object.params[index] = object.scale;
                        }
                    }

                    newObject = this._instantiateObject(object.id, object.gameObject, object.params);
                    this.objects.push(newObject);
                // decoration mesh
                } else {
                    object.params = object.params == null ? {} : object.params;

                    newObject = GF.Utils.build3DObject(this._game.loader, {
                        model: object.model,
                        material: object.material ? object.material : Object.assign({
                            texture: object.texture
                        }, object.params.material != null ? object.params.material : {})
                    })
                    newObject.castShadow = object.params.castShadow != null ? object.params.castShadow : true;
                    newObject.receiveShadow = object.params.receiveShadow != null ? object.params.receiveShadow : true;

                    newObject.position.set(object.position.x, object.position.y, object.position.z);
                    newObject.rotation.set(object.rotation.x, object.rotation.y, object.rotation.z);
                    newObject.scale.set(object.scale.x, object.scale.y, object.scale.z);

                    // add collision volume
                    if (object.collision) {
                        const cv = this._game.physics.addVolume(null, GF.Utils.buildCollisionVolumeFrom3DObject(newObject), newObject.position);
                        this.collisionVolumes.push(cv);
                    }

                    this.sceneObjects.push(newObject);
                    this._game.addToScene(newObject, object.rayCollision);
                }
            }
        }
    }

    /**
     * Init
     */
    init() {
        this.sceneObjects = [];
        this.objects = [];
        this.collisionVolumes = [];
        this.sceneAssetData = this._game.loader.get(this._sceneAsset);

        if (this.sceneAssetData) {
            if (this._sceneType === "jgf") {
                this._initForJGFScene();
            } else {
                this._initForThreeJsScene();
            }
        }
    }

    /**
     * Destroy
     */
    destroy() {
        for (var i = 0; i < this.sceneObjects.length; i++) {
            this._game.removeFromScene(this.sceneObjects[i]);
        }

        for (var i = 0; i < this.objects.length; i++) {
            this.objects[i].destroy();
        }

        for (var i = 0; i < this.collisionVolumes.length; i++) {
            this._game.physics.removeVolume(this.collisionVolumes[i].id)
        }
    }
}
GF.ParticleSystemMaterials = {};

/**
 * Get particle material
 * @returns 
 */
function getParticleMaterial(game, texture, color, opacity, isParticlePositionLocal) {
	if (GF.ParticleSystemMaterials != null) {
		const id = texture + (color.r + color.g + color.b) + opacity + isParticlePositionLocal;
		if (GF.ParticleSystemMaterials[id] == null) {
			GF.ParticleSystemMaterials[id] = new THREE.ShaderMaterial( {
				uniforms: {
					color: { value: new THREE.Vector3(color.r, color.g, color.b) },
					map: { value: game.loader.get(texture) },
					isParticlePositionLocal:  { value: isParticlePositionLocal },
					globalOpacity: { value: opacity },
				},
				vertexShader: `
					attribute float size;
					attribute float opacity;
					uniform bool isParticlePositionLocal;
					varying float vOpacity;
	
					void main() {
	
						vec4 mvPosition;
						if (isParticlePositionLocal) {
							mvPosition = modelViewMatrix * vec4( position, 1.0 );
						} else {
							mvPosition = viewMatrix * vec4( position, 1.0 );
						}
	
						vOpacity = opacity;
						gl_PointSize *= ( size / - mvPosition.z );
	
						gl_Position = projectionMatrix * mvPosition;
	
					}
				`,
				fragmentShader: `
					varying float vOpacity;
					uniform vec3 color;
					uniform sampler2D map;
					uniform float globalOpacity;
	
					void main() {
	
						gl_FragColor = vec4( color, vOpacity * globalOpacity );
						gl_FragColor = gl_FragColor * texture2D( map, gl_PointCoord );
	
					}
				`,
				blending: THREE.AdditiveBlending,
				depthTest: true,
				depthWrite: false,
				transparent: true
			} );
		}
		return GF.ParticleSystemMaterials[id];
	}
}

/**
 * ParticleSystem
 */
GF.ParticleSystem = class ParticleSystem extends GF.EmptyObject {

    /**
     * Particle System
	 * 
	 * @param {Params} params the params to build the particle system:
	 * 
	 * ### Params ###
	 * * `color: number` - the color of the particles
	 * * `opacity: number` - the opacity of the particles
	 * * `texture: string` - the texture asset for the particles
	 * * `particleCount: number` - the max number of particles at a time
	 * * `size: number` - the size of the particles
	 * * `velocity: THREE.Vector3` - the velocity applied to each particle
	 * * `lifetime: number` - the lifetime of each particle
	 * * `spawnDelay: number` - the delay between each particle spawn 'tick'
	 * * `spawnCount: number` - the count of particles spawn at each spawn 'tick'
	 * * `spawnBox: THREE.Vector3` - spawn box (sizeX, sizeY, sizeZ)
	 * * `isParticlePositionLocal: boolean` - if particles are positioned relative to the world or to the local particle system origin
	 * * `hasSizeAttenuation: boolean` - if particles size will be reduced along with the life time
	 * * `offset: THREE.Vector3` - particles position offset
     */
	constructor(params) {
		super();
		this.object3D = new THREE.Object3D();
		this.color = params.color != null ? params.color : 0xFFFFFF;
		this.opacity = params.opacity;
		this.texture = params.texture;
		this.maxParticleCount = params.particleCount != null ? params.particleCount : 100;
		this.size = params.size != null ? params.size : 1;
		this.velocity = params.velocity != null ? params.velocity : new THREE.Vector3(0,0,0);
		this.lifetime = params.lifetime != null ? params.lifetime : 1000;
		this.spawnDelay = params.spawnDelay != null ? params.spawnDelay : 0;
		this.spawnCount = params.spawnCount != null ? params.spawnCount : 1;
		this.spawnBox = params.spawnBox != null ? params.spawnBox : new THREE.Vector3(0,0,0);
		this.isParticlePositionLocal = params.isParticlePositionLocal != null ? params.isParticlePositionLocal : false;
		this.hasSizeAttenuation = params.hasSizeAttenuation != null ? params.hasSizeAttenuation : false;
		this.offset = params.offset != null ? params.offset : new THREE.Vector3(0,0,0);
	}

	/**
	 * Set visibility of particle system
	 * @param {boolean} visible 
	 */
	setVisible(visible) {
		if (visible) {
			if (!this.object3D.visible) {
				this.resetParticles();
				this.object3D.visible = true;
			}
		} else {
			this.object3D.visible = false;
		}
	}

	/**
	 * Reset particles
	 */
	resetParticles() {
		this.positionIndex = 0;
		for (this.i = 0; this.i < this.maxParticleCount; this.i++ ) {
			this.positionIndex = this.i * 3;

			// set life
			this.attributes.life.array[this.i] = 0;

			// set size
			this.attributes.size.array[this.i] = 0;

			// set position
			this.attributes.position.array[this.positionIndex] = 0;
			this.attributes.position.array[this.positionIndex + 1] = 0;
			this.attributes.position.array[this.positionIndex + 2] = 0;

			// opacity
			this.attributes.opacity.array[this.i] = 0;
		}
	  
		// flag to update
		this.attributes.position.needsUpdate = true;
		this.attributes.life.needsUpdate = true;
		this.attributes.size.needsUpdate = true;
		this.attributes.opacity.needsUpdate = true;
	}
	
    /**
     * Init
     */
	onInit() {
		const color = new THREE.Color(this.color);

		var material = getParticleMaterial(this.game, this.texture, color, this.opacity, this.isParticlePositionLocal);

		// create the attributes arrays
		var vertices = new Float32Array(this.maxParticleCount * 3),
		size = new Float32Array(this.maxParticleCount),
		opacity = new Float32Array(this.maxParticleCount),
		life = new Float32Array(this.maxParticleCount);
		for ( var i = 0; i < this.maxParticleCount; i ++ ) {
			size[this.i] = this.size;
		}
		var geometry = new THREE.BufferGeometry();
		geometry.setAttribute( 'position', new THREE.Float32BufferAttribute( vertices, 3 ) );
		geometry.setAttribute( 'size', new THREE.Float32BufferAttribute( size, 1 ) );
		geometry.setAttribute( 'life', new THREE.Float32BufferAttribute( life, 1 ) );
		geometry.setAttribute( 'opacity', new THREE.Float32BufferAttribute( opacity, 1 ) );
		
		// create the particle system
		this.object3D = new THREE.Points(geometry, material);
		this.position = this.object3D.position;
		this.attributes = this.object3D.geometry.attributes;
		this.addToScene(this.object3D);

		// update the particle system to sort the particles
		this.object3D.sortParticles = true;

		this.timeToSpawn = 0;
	}

    /**
     * Update
	 * @param {number} delta 
     */
	onUpdate(delta) {
		if (this.object3D.position.distanceTo(this.game.camera.position) >= this.game.viewFarPlane) {
			return;
		}

		this.dimensions = this.game.getCanvasDimensions();
		this.minDimension = Math.min(this.dimensions.width, this.dimensions.height)

		this.attributes = this.object3D.geometry.attributes;

		this.timeToSpawn += delta;

		// spawn particles
		if (this.timeToSpawn >= this.spawnDelay) {
			this.timeToSpawn = 0;

			this.count = this.spawnCount;
			if (this.spawnCount > 0) {
				for (this.i = 0; this.i < this.maxParticleCount; this.i++) {
					this.positionIndex = this.i * 3;

					if (this.attributes.life.array[this.i] === 0) {
						// set life
						this.attributes.life.array[this.i] = this.lifetime;

						// set size
						this.attributes.size.array[this.i] = this.size;

						// set position
						this.attributes.position.array[this.positionIndex] = (Math.random() * this.spawnBox.x - (this.spawnBox.x * 0.5)) + (this.isParticlePositionLocal ? 0 : this.object3D.position.x + this.offset.x);
						this.attributes.position.array[this.positionIndex + 1] = (Math.random() * this.spawnBox.y - (this.spawnBox.y * 0.5)) + (this.isParticlePositionLocal ? 0 : this.object3D.position.y + this.offset.y);
						this.attributes.position.array[this.positionIndex + 2] = (Math.random() * this.spawnBox.z - (this.spawnBox.z * 0.5)) + (this.isParticlePositionLocal ? 0 : this.object3D.position.z + this.offset.z);

						// opacity
						this.attributes.opacity.array[this.i] = 1;

						this.count--;
					}

					if (this.count <= 0) {
						break;
					}
				}
			}
		}

		// update particles
		this.positionIndex = 0;
		for (this.i = 0; this.i < this.maxParticleCount; this.i++ ) {
			if (this.attributes.life.array[this.i] > 0) {
				this.positionIndex = this.i * 3;
				// position
				this.attributes.position.array[this.positionIndex] += this.velocity.x * delta;
				this.attributes.position.array[this.positionIndex + 1] += this.velocity.y * delta;
				this.attributes.position.array[this.positionIndex + 2] += this.velocity.z * delta;

				// set opacity
				this.attributes.opacity.array[this.i] = this.attributes.life.array[this.i] / this.lifetime;

				// set size
				if (this.hasSizeAttenuation) {
					this.attributes.size.array[this.i] = (this.size * 0.001 * this.minDimension) * this.attributes.opacity.array[this.i];
				}

				// set life
				this.attributes.life.array[this.i] -= delta;
				if (this.attributes.life.array[this.i] < 0) {
					this.attributes.life.array[this.i] = 0;
					this.attributes.opacity.array[this.i] = 0;
					this.attributes.position.array[this.positionIndex] = 0;
					this.attributes.position.array[this.positionIndex + 1] = 0;
					this.attributes.position.array[this.positionIndex + 2] = 0;
				}
			}
		}
	  
		// flag to update
		this.attributes.position.needsUpdate = true;
		this.attributes.life.needsUpdate = true;
		this.attributes.size.needsUpdate = true;
		this.attributes.opacity.needsUpdate = true;
	}
}

/**
 * Explosion particles effect
 * @param {GF.Game} game a pointer to the game instance
 * @param {Vector3} position the position
 * @param {HaloParticles} haloParticles
 * #### HaloParticles ####
* * `texture: string` - the texture asset for the particles
* * `color: number` - the color of the particles
* * `opacity: number` - the opacity of the particles
* * `minSpeed: number` - the min applied to each particle
* * `maxSpeed: number` - the max applied to each particle
* * `life: number` - the lifetime of each particle
* * `size: number` - the size of each particle
* * `particleCount: number` - the particle count
* * `maxSpeedAngle: number` - the max vertical angle to throw a particle
* @param {FireParticles} fireParticles
* #### FireParticles ####
* * `texture: string` - the texture asset for the particles
* * `color: number` - the color of the particles
* * `opacity: number` - the opacity of the particles
* * `minSpeed: number` - the min applied to each particle
* * `maxSpeed: number` - the max applied to each particle
* * `life: number` - the lifetime of each particle
* * `size: number` - the size of each particle
* * `particleCount: number` - the particle count
* * `spawnBoxSize: number` - the size of the area where fire particles will be spawn
*/
GF.ExplosionEffect = function(game, position, haloParticles, fireParticles) {
	var canvasDimensions, sizeAttenuator, positionIndex;

	this.finished = true;
	this.game = game; 
	this.haloParticles = haloParticles;
	this.fireParticles = fireParticles;

	// create object for halo particles
	if (this.haloParticles) {
		var vertices = new Float32Array(this.haloParticles.particleCount * 3);
		var speed = new Float32Array(this.haloParticles.particleCount * 3);
		var opacity = new Float32Array(this.haloParticles.particleCount);
		var life = new Float32Array(this.haloParticles.particleCount);
		var size = new Float32Array(this.haloParticles.particleCount);

		var geometry = new THREE.BufferGeometry();
		geometry.setAttribute('position', new THREE.Float32BufferAttribute( vertices, 3 ) );
		geometry.setAttribute('speed', new THREE.Float32BufferAttribute( speed, 3 ) );
		geometry.setAttribute('size', new THREE.Float32BufferAttribute( size, 1 ) );
		geometry.setAttribute('life', new THREE.Float32BufferAttribute( life, 1 ) );
		geometry.setAttribute('opacity', new THREE.Float32BufferAttribute( opacity, 1 ) );

		// dynamic flag
		geometry.attributes.position.setUsage(THREE.DynamicDrawUsage);
		geometry.attributes.speed.setUsage(THREE.DynamicDrawUsage);
		geometry.attributes.life.setUsage(THREE.DynamicDrawUsage);
		geometry.attributes.size.setUsage(THREE.DynamicDrawUsage);
		geometry.attributes.opacity.setUsage(THREE.DynamicDrawUsage);

		var material = getParticleMaterial(game, this.haloParticles.texture, new THREE.Color(this.haloParticles.color), this.haloParticles.opacity, true)
		
		this.halo = new THREE.Points(geometry, material);
		this.halo.sortParticles = true;
		this.halo.position.set(position.x, position.y, position.z);
		this.game.scene.add(this.halo)

		this.haloParticlesAttributes = this.halo.geometry.attributes;
	}

	// create object for smoke particles
	if (this.fireParticles) {
		var vertices = new Float32Array(this.fireParticles.particleCount * 3);
		var speed = new Float32Array(this.haloParticles.particleCount * 3);
		var opacity = new Float32Array(this.fireParticles.particleCount);
		var life = new Float32Array(this.fireParticles.particleCount);
		var size = new Float32Array(this.haloParticles.particleCount);

		var geometry = new THREE.BufferGeometry();
		geometry.setAttribute('position', new THREE.Float32BufferAttribute( vertices, 3 ) );
		geometry.setAttribute('speed', new THREE.Float32BufferAttribute( speed, 3 ) );
		geometry.setAttribute('size', new THREE.Float32BufferAttribute( size, 1 ) );
		geometry.setAttribute('life', new THREE.Float32BufferAttribute( life, 1 ) );
		geometry.setAttribute('opacity', new THREE.Float32BufferAttribute( opacity, 1 ) );

		// dynamic flag
		geometry.attributes.position.setUsage(THREE.DynamicDrawUsage);
		geometry.attributes.speed.setUsage(THREE.DynamicDrawUsage);
		geometry.attributes.life.setUsage(THREE.DynamicDrawUsage);
		geometry.attributes.size.setUsage(THREE.DynamicDrawUsage);
		geometry.attributes.opacity.setUsage(THREE.DynamicDrawUsage);

		var material = getParticleMaterial(game, this.fireParticles.texture, new THREE.Color(this.fireParticles.color), this.fireParticles.opacity, true)
		
		this.fire = new THREE.Points(geometry, material);
		this.fire.sortParticles = true;
		this.fire.position.set(position.x, position.y, position.z);
		this.game.scene.add(this.fire)

		this.fireParticlesAttributes = this.fire.geometry.attributes;
	}

	/**
	 * Set position
	 */
	this.setPosition = function (x, y, z) {
		if (this.halo) {
			this.halo.position.set(x, y, z);
		}

		if (this.fire) {
			this.halo.position.set(x, y, z)
		}
	}

	/**
	 * Reset effect simulation
	 */
	this.play = function () {
		if (this.finished) {
			this.finished = false;

			// update halo particles
			if (this.haloParticles && this.haloParticlesAttributes) {
				var angleIncrement = (Math.PI * 2) / this.haloParticles.particleCount
				for (var i = 0; i < this.haloParticles.particleCount; i++) {
					positionIndex = i * 3;

					if (this.haloParticlesAttributes.life.array[i] === 0) {
						// set life
						this.haloParticlesAttributes.life.array[i] = this.haloParticles.life;

						// set size
						this.haloParticlesAttributes.size.array[i] = 1;

						// opacity
						this.haloParticlesAttributes.opacity.array[i] = 1;

						// set position
						this.haloParticlesAttributes.position.array[positionIndex] = 0;
						this.haloParticlesAttributes.position.array[positionIndex + 1] = 0;
						this.haloParticlesAttributes.position.array[positionIndex + 2] = 0;

						// set speed
						speed = new THREE.Vector3(
							Math.cos(angleIncrement * i),
							Math.sin((Math.random() * this.haloParticles.maxSpeedAngle * 2) - this.haloParticles.maxSpeedAngle),
							Math.sin(angleIncrement * i)
						);
						speed.multiplyScalar(this.haloParticles.minSpeed + (Math.random() * (this.haloParticles.maxSpeed - this.haloParticles.minSpeed)));

						this.haloParticlesAttributes.speed.array[positionIndex] = speed.x;
						this.haloParticlesAttributes.speed.array[positionIndex + 1] = speed.y;
						this.haloParticlesAttributes.speed.array[positionIndex + 2] = speed.z;
					}
				}

				this.haloParticlesAttributes.speed.needsUpdate = true;
			}

			// update fire particles
			if (this.fireParticles && this.fireParticlesAttributes) {
				for (var i = 0; i < this.fireParticles.particleCount; i++) {
					positionIndex = i * 3;

					if (this.fireParticlesAttributes.life.array[i] === 0) {
						// set life
						this.fireParticlesAttributes.life.array[i] = this.fireParticles.life;

						// set size
						this.fireParticlesAttributes.size.array[i] = 1;

						// opacity
						this.fireParticlesAttributes.opacity.array[i] = 1;

						// set position
						this.fireParticlesAttributes.position.array[positionIndex] = (Math.random() * this.fireParticles.spawnBoxSize) - (this.fireParticles.spawnBoxSize * 0.5);
						this.fireParticlesAttributes.position.array[positionIndex + 1] = (Math.random() * this.fireParticles.spawnBoxSize) - (this.fireParticles.spawnBoxSize * 0.5);
						this.fireParticlesAttributes.position.array[positionIndex + 2] = (Math.random() * this.fireParticles.spawnBoxSize) - (this.fireParticles.spawnBoxSize * 0.5);

						// set speed
						this.fireParticlesAttributes.speed.array[positionIndex] = 0;
						this.fireParticlesAttributes.speed.array[positionIndex + 1] = this.fireParticles.minSpeed + (Math.random() * (this.fireParticles.maxSpeed - this.fireParticles.minSpeed));
						this.fireParticlesAttributes.speed.array[positionIndex + 2] = 0;
					}
				}

				this.fireParticlesAttributes.speed.needsUpdate = true;
			}
		}
	};

	/**
	 * Advance particles
	 */
	this.advanceParticles = function(particles, particlesAttributes, delta, sizeAttenuator) {
		if (particles && particlesAttributes) {
			for (var i = 0; i < particles.particleCount; i++) {
				if (particlesAttributes.life.array[i] > 0) {
					positionIndex = i * 3;
					// position
					particlesAttributes.position.array[positionIndex] += particlesAttributes.speed.array[positionIndex] * delta;
					particlesAttributes.position.array[positionIndex + 1] += particlesAttributes.speed.array[positionIndex + 1] * delta;
					particlesAttributes.position.array[positionIndex + 2] += particlesAttributes.speed.array[positionIndex + 2] * delta;
	
					// set opacity
					particlesAttributes.opacity.array[i] = particlesAttributes.life.array[i] / particles.life;
	
					// set size
					particlesAttributes.size.array[i] = particles.size * sizeAttenuator;
	
					// set life
					particlesAttributes.life.array[i] -= delta;
					if (particlesAttributes.life.array[i] < 0) {
						particlesAttributes.life.array[i] = 0;
						particlesAttributes.opacity.array[i] = 0;
					}
				}
			}

			particlesAttributes.position.needsUpdate = true;
			particlesAttributes.life.needsUpdate = true;
			particlesAttributes.size.needsUpdate = true;
			particlesAttributes.opacity.needsUpdate = true;
		}
	}

	/**
	 * Advance effect simulation
	 */
	this.advance = function(delta) {
		if (!this.finished) {
			canvasDimensions = this.game.getCanvasDimensions();
			sizeAttenuator = Math.min(canvasDimensions.width, canvasDimensions.height) * 0.1;

			this.advanceParticles(this.haloParticles, this.haloParticlesAttributes, delta, sizeAttenuator);

			this.advanceParticles(this.fireParticles, this.fireParticlesAttributes, delta, sizeAttenuator)

			if ((this.haloParticlesAttributes == null || this.haloParticlesAttributes.life.array.every(i => i === 0))
			&& (this.fireParticlesAttributes == null || this.fireParticlesAttributes.life.array.every(i => i === 0))) {
				this.finished = true;
			}
		}
	}

	/**
	 * Destroy
	 */
	this.dispose = function() {
		if (this.halo) {
			this.game.scene.remove(this.halo);
		}
		if (this.fire) {
			this.game.scene.remove(this.fire);
		}
	}
}
/**
 * CameraShaker
 */
 GF.CameraShaker = class CameraShaker {

	/**
	 * Constructor
	 * @param {THREE.Camera} camera the scene camera
	 */
	constructor(camera) {
		this.camera = camera;
		this._running = false;
	}

	/**
	 * Update
	 */
	update() {
		if (this._running == true) {
			const now = Date.now();
			if (this._endTime > now) {
				let delta = (Date.now() - this._startTime) / this._duration;
				
				switch(this._type) {
					case GF.CameraShaker.WAVE:
						this._position = Math.sin(delta * Math.PI * 2);
						this.camera.position.add(this._direction.clone().multiplyScalar(this._position * this._amount));
						break;
				}
			} else {
				this._running = false;
			};
		};
	};

	/**
	 * Shake the camera
	 * @param {AnimationType} type the animation type
	 * @param {THREE.Vector3} direction vector
	 * @param {number} milliseconds duration
	 */
	shake(type, direction, amount, milliseconds) {
		if (!this._running) {
			this._type = type;
			this._direction = direction;
			this._amount = amount;
			this._running = true ;
			this._startTime = Date.now();
			this._endTime = this._startTime + milliseconds;
			this._duration = milliseconds;
		}
	};
}

/**
 * Camera Shaker types
 */
GF.CameraShaker.WAVE = 0; // sinusoidal wave animation

/**
 * GameEditor
 */
 GF.GameEditor = class GameEditor {
    constructor(game) {
        this.game = game;
        this.gridResolution = 1;
        this.gridSize = 100;
        this.snapToGrid = false;
        this.selectedObject = null;
        this.objects = [];
        this.mouse = new THREE.Vector2();
        this.raycaster = new THREE.Raycaster();

        this.DEFAULT_COLOR = 0xCCCCCC;
        this.HIGHLIGHTED_COLOR = 0xFFFFFF;
    }

    //#region Load/Save API

    /**
     * Load scene
     */
    loadScene(fromFile, file) {
        this.resetScene();

        var json;
        if (!fromFile) {
            json = localStorage["Jgf_editor_auto_save"];
            if (json) {
                json = JSON.parse(json);
            }
            this.parseSceneJSON(json);
        } else {
            var fr = new FileReader();

            fr.onload = () => {
                json = JSON.parse(fr.result);
                this.parseSceneJSON(json);
            }
              
            fr.readAsText(file);
        }
    }

    /**
     * Save scene
     */
    saveScene(toFile, file) {
        var json = this.prettifyJSON(this.generateSceneJSON());

        if (!toFile) {
            localStorage["Jgf_editor_auto_save"] = json;
        } else {
            GF.Utils.download(json, file, "json");
        }
    }

    /**
     * Reset scene
     */
    resetScene() {
        this.selectObject(null);
        for (const obj of this.objects) {
            this.game.removeFromScene(obj);
        }
        this.objects.length = 0;
    }

    //#endregion
    
    //#region Internal

    /**
     * Generate scene json
     * @returns 
     */
    generateSceneJSON() {
        var scene = {
            objects: [],
            lights: [
                // {
                //     color: 0xFFFF00,
                //     intensity: 0.5,
                //     position: {x: 0, y: 0, z: 0},
                //     distance: 20,
                //     shadows: true
                // }
            ],
            ambient: {
                sun: null,
                // {
                //     direction: {x: 0, y: 0, z: 0},
                //     color: 0xFFFFFF,
                //     intensity: 1,
                //     shadows: true
                // },
                sky: null
                // {
                //     top: 0xFFFFFF,
                //     bottom: 0xFFFFFF,
                //     intensity: 0.5
                // }
            }
        }

        for (const obj of this.objects) {
            if (obj._jgf_editor_object != null) {
                var newObject = Object.assign({}, obj._jgf_editor_object);

                if (newObject.gameObject != null) {
                    delete newObject.texture;
                    delete newObject.model;
                }

                if (newObject.params) {
                    newObject.params = JSON.parse(newObject.params);
                }

                newObject.position = {
                    x: obj.position.x,
                    y: obj.position.y,
                    z: obj.position.z
                };
                newObject.rotation = {
                    x: obj.rotation.x,
                    y: obj.rotation.y,
                    z: obj.rotation.z
                };
                newObject.scale = {
                    x: obj.scale.x,
                    y: obj.scale.y,
                    z: obj.scale.z
                }

                delete newObject._geometry;
                delete newObject._material;
                delete newObject._thumbnail;

                scene.objects.push(newObject);
            }
        }

        return scene;
    }

    /**
     * Parse scene json
     */
    parseSceneJSON(json) {
        if (json != null && json.objects) {
            for (const obj of json.objects) {
                this.addObject(obj.name, {
                    position: obj.position,
                    rotation: obj.rotation,
                    scale: obj.scale,
                    params: this.prettifyJSON(obj.params),
                    collision: obj.collision,
                    rayCollision: obj.rayCollision,
                    id: obj.id,
                }, false)
            }
        }
    }

    /**
     * Prettify JSON
     * @param {string} json 
     * @returns 
     */
    prettifyJSON(json) {
        return JSON.stringify(json, undefined, 2);
    }

    /**
     * Generates an object thumbnail image
     * @param object
     */
    generateObjectThumbnail(object) {
        object.geometry.computeBoundingSphere();

        const renderer = new THREE.WebGLRenderer({ alpha: true });
        renderer.setPixelRatio(window.devicePixelRatio);
        renderer.setSize(64, 64);
        renderer.sortObjects = false;
        renderer.setClearColor(0x000000, 0);

        const camera = new THREE.PerspectiveCamera(70, 1, 0.01, 10000);
        const dist = object.geometry.boundingSphere.radius * 1.25;
        camera.position.set(dist, dist, dist);
        camera.lookAt(new THREE.Vector3(0, object.geometry.boundingSphere.center.y, 0));

        const scene = new THREE.Scene();

        scene.add(object);

        renderer.render(scene, camera);

        renderer.dispose();

        return renderer.domElement.toDataURL();
    }

    /**
     * Get object geometry
     * @param {*} asset 
     * @returns 
     */
    getObjectGeometry(asset) {
        var geometry;
        if (asset.model) {
            geometry = this.game.loader.get(asset.model);
            if (geometry.type != "Geometry" && geometry.type != "BufferGeometry") {
                geometry.traverse((child) => {
                    if (child.geometry != null) {
                        geometry = child.geometry;
                        return -1;
                    }
                })
            }
        } else {
            geometry = new THREE.BoxGeometry(1, 1, 1 );
        }

        if (asset.rotation) {
            geometry.rotateX(GF.Utils.degToRad(asset.rotation.x));
            geometry.rotateY(GF.Utils.degToRad(asset.rotation.y));
            geometry.rotateZ(GF.Utils.degToRad(asset.rotation.z));
        }

        if (asset.scale) {
            geometry.scale(asset.scale.x, asset.scale.y, asset.scale.z)
        }

        return geometry;
    }

    /**
     * Get object material
     * @param {*} texture 
     * @returns 
     */
    getObjectMaterial(texture, color) {
        return new THREE.MeshBasicMaterial({map: texture != null ? this.game.loader.get(texture) : null, color: color != null ? Number(color) : this.DEFAULT_COLOR})
    }

    //#endregion

    //#region API

    /**
     * Set grid visible
     * @param {boolean} visible 
     */
    setGridVisible(visible) {
        this.gridHelper.visible = visible;
        this.axesHelper.visible = visible;
    }

    /**
     * Set grid
     * @param {number} size 
     * @param {number} resolution 
     */
    setGrid(size, resolution) {
        this.gridSize = size;
        this.gridResolution = resolution;

        if (this.gridHelper) {
            this.game.removeFromScene(this.gridHelper);
            this.gridHelper.material.dispose();
            this.gridHelper.geometry.dispose();
        }

        if (this.axesHelper) {
            this.game.removeFromScene(this.axesHelper);
            this.axesHelper.material.dispose();
            this.axesHelper.geometry.dispose();
        }

        if (size != null) {
            this.gridHelper = new THREE.GridHelper( size, size / resolution );
            this.game.addToScene(this.gridHelper);

            this.axesHelper = new THREE.AxesHelper( resolution * 10 );
            this.axesHelper.position.y = 0.01;
            this.game.addToScene(this.axesHelper);

            this.setTranslationSnap(this.translationSnap);
            this.setRotationSnap(this.rotationSnap);
            this.setScaleSnap(this.scaleSnap);
        }
    }

    /**
     * Add object
     * @param name name of object to add
     */
    addObject(name, params, select = true) {
        if (this.metadata && this.metadata.assets) {
            var object = this.metadata.assets.find(o => o.name === name);
            if (object) {
                var mesh = new THREE.Mesh(object._geometry, object._material.clone());

                mesh._jgf_editor_object = Object.assign({id: GF.Utils.uniqueId(object.name)}, object);
                mesh._jgf_editor_object.params = this.prettifyJSON(mesh._jgf_editor_object.params);
                mesh._jgf_editor_object.rayCollision = mesh._jgf_editor_object.rayCollision != null ? mesh._jgf_editor_object.rayCollision : false;
                mesh._jgf_editor_object.collision = mesh._jgf_editor_object.collision != null ? mesh._jgf_editor_object.collision : false;

                if (params) {
                    if (params.position) {
                        mesh.position.set(params.position.x, params.position.y, params.position.z);
                    }
                    if (params.rotation) {
                        mesh.rotation.set(params.rotation.x, params.rotation.y, params.rotation.z);
                    }
                    if (params.scale) {
                        mesh.scale.set(params.scale.x, params.scale.y, params.scale.z);
                    }

                    if (params.id) {
                        mesh._jgf_editor_object.id = params.id;
                    }

                    if (params.collision) {
                        mesh._jgf_editor_object.collision = params.collision;
                    }

                    if (params.rayCollision) {
                        mesh._jgf_editor_object.rayCollision = params.rayCollision;
                    }

                    if (params.params) {
                        mesh._jgf_editor_object.params = params.params;
                    }
                }

                this.game.addToScene(mesh);
                this.objects.push(mesh);

                if (!select) {
                    setTimeout(() => {
                        this.selectObject(mesh);
                    })
                }
            }
        }
    }

    /**
     * Remove selected object
     */
    removeSelectedObject() {
        if (this.selectedObject) {
            this.game.removeFromScene(this.selectedObject);
            
            var index = this.objects.indexOf(this.selectedObject);
            if (index >= 0) {
                this.objects.splice(index, 1);
            }

            this.selectObject(null);
        }
    }

    /**
     * Duplicate selected object
     */
    duplicateSelectedObject() {
        if (this.selectedObject) {
            const params = Object.assign({}, this.selectedObject._jgf_editor_object);
            delete params.id;
            params.position = this.selectedObject.position.clone();
            params.rotation = this.selectedObject.rotation.clone();
            params.scale = this.selectedObject.scale.clone();
            this.addObject(this.selectedObject._jgf_editor_object.name, params, true)
        }
    }

    /**
     * Select object
     * @param {Object3D} object 
     */
    selectObject(object) {
        this.selectedObject = object;

        if (this.selectedObject != null) {
            this.transformControls.attach(this.selectedObject);

            this.game.removeFromScene(this.selectedBoxHelper);
            this.selectedBoxHelper = new THREE.BoxHelper( this.selectedObject, this.selectedObject._jgf_editor_object.gameObject != null ? 0x00FFFF : 0xFFFFAA );
            this.game.addToScene(this.selectedBoxHelper);
        } else {
            this.game.removeFromScene(this.selectedBoxHelper);
            this.transformControls.detach();
        }

        this.game.gamePage.setSelectedObject(this.selectedObject);
    }

    /**
     * Set selected object id
     */
    setSelectedObjectId(newId) {
        if (this.selectedObject && !this.objects.find(o => o._jgf_editor_object.id === newId)) {
            this.selectedObject._jgf_editor_object.id = newId;
        }
    }

    /**
     * Set selected object params
     */
    setSelectedObjectParams(params) {
        if (this.selectedObject) {
            this.selectedObject._jgf_editor_object.params = params;
        }
    }

    /**
     * Set selected object collision
     */
    setSelectedObjectCollision(collision) {
        if (this.selectedObject) {
            this.selectedObject._jgf_editor_object.collision = collision;
        }
    }

    /**
     * Set selected object ray collision
     */
     setSelectedObjectRayCollision(collision) {
        if (this.selectedObject) {
            this.selectedObject._jgf_editor_object.rayCollision = collision;
        }
    }

    /**
     * Set selected object transform
     */
    setSelectedObjectTransform(type, axis, value) {
        if (this.selectedObject) {
            this.selectedObject[type][axis] = type === "rotation" ? GF.Utils.degToRad(Number(value)) : Number(value);
        }
    }

    /**
     * Set selected object property value
     * @param {string[]} propertyArray 
     * @param {any} value 
     */
    setSelectedObjectProperty(propertyArray, value) {
        if (this.selectedObject && propertyArray != null) {
            if (propertyArray instanceof Array) {
                var object = this.selectedObject;
                var property;
                while(propertyArray.length > 1) {
                    property = propertyArray.shift();
                    object = object[property];
                }
                object[propertyArray.shift()] = value;
            } else {
                this.selectedObject[propertyArray] = value;
            }
        }
    }

    /**
     * Get selected object params
     */
    getSelectedObjectParams() {
        if (this.selectedObject && this.selectedObject._jgf_editor_object) {
            return this.selectedObject._jgf_editor_object.params;
        }
    }

    /**
     * Get selected object property value
     * @param {string[]} propertyArray
     */
    getSelectedObjectPosition(propertyArray) {
        if (this.selectedObject && propertyArray != null) {
            if (propertyArray instanceof Array) {
                var object = this.selectedObject;
                var property;
                while(propertyArray.length > 1) {
                    property = propertyArray.shift();
                    object = object[property];
                }
                return object[propertyArray.shift()];
            } else {
                return this.selectedObject[propertyArray];
            }
        }
    }

    /**
     * Set transform mode
     * @param {*} mode 
     */
    setTransformMode(mode) {
        this.transformControls.setMode(mode);
    }

    /**
     * Set translation snap
     * @param {boolean} snap 
     */
    setTranslationSnap(snap) {
        this.translationSnap = snap;
        this.transformControls.setTranslationSnap(snap ? this.gridResolution : null);
    }

    /**
     * Set rotation snap
     * @param {boolean} snap 
     */
    setRotationSnap(snap) {
        this.rotationSnap = snap;
        this.transformControls.setRotationSnap(snap ? GF.Utils.degToRad(10) : null);
    }

    /**
     * Set scale snap
     * @param {boolean} snap 
     */
    setScaleSnap(snap) {
        this.scaleSnap = snap;
        this.transformControls.setScaleSnap(snap ? this.gridResolution * 0.5 : null);
    }

    //#endregion

    //#region life cycle

    /**
     * Set editor parameters
     * @param {any} params 
     */
    setParams(params) {
        this.params = params;

        if (this.params.metadata) {
            var loader = new GF.JSONFileLoader();
            loader.load(this.params.metadata, (data) => {
                this.metadata = data;

                for (const asset of this.metadata.assets) {
                    asset._geometry = this.getObjectGeometry(asset);
                    asset._material = this.getObjectMaterial(asset.texture, asset.color);

                    asset._thumbnail = this.generateObjectThumbnail(new THREE.Mesh(asset._geometry, asset._material));
                }

                this.game.gamePage.setObjectsList(this.metadata.assets);
            })
        }
    }

    /**
     * On mouse move
     */
    onMouseMove(event) {
        const rect = this.game._renderer.domElement.getBoundingClientRect();
        this.mouse.x = ( (event.clientX - rect.x) / rect.width ) * 2 - 1;
        this.mouse.y = - ( (event.clientY - rect.y) / rect.height ) * 2 + 1;

        if (this.highlightedObject) {
            this.highlightedObject.material.color.setHex(this.highlightedObject._jgf_editor_object.color != null ? this.highlightedObject._jgf_editor_object.color : this.DEFAULT_COLOR);
            this.highlightedObject = null;
        }

        // update the picking ray
        this.raycaster.setFromCamera(this.mouse, this.game.camera);

        // calculate objects intersecting the picking ray
        var intersections = this.raycaster.intersectObjects(this.objects);

        if (intersections.length > 0) {
            this.highlightedObject = intersections[0].object;
            if (this.highlightedObject) {
                this.highlightedObject.material.color.setHex(this.HIGHLIGHTED_COLOR);
            }
        }
    }

    /**
     * On mouse click
     */
    onMouseClick() {
        if (this.highlightedObject) {
            this.selectObject(this.highlightedObject);
        }
    }

    /**
     * Init
     */
    init() {
        // camera controls
        this.game.setCamera({x: 10, y: 10, z: 10}, {x: 0, y: 0, z: 0})
        this.cameraControls = new THREE.OrbitControls(this.game.camera, this.game.gamePage.controlsTarget[0]);

        // transform controls
        this.transformControls = new THREE.TransformControls(this.game.camera, this.game.gamePage.controlsTarget[0]);
        this.game.addToScene(this.transformControls);
        this.transformControls.setMode("translate");
        this.game.gamePage.setTransformMode('translate');
        this.setTranslationSnap(true);
        this.setRotationSnap(true);
        this.setScaleSnap(true);

        // set grid
        this.setGrid(this.gridSize, this.gridResolution);

        this.onTransformBegin = () => {
            this.cameraControls.enablePan = false;
            this.cameraControls.enableZoom = false;
            this.cameraControls.enableRotate = false;
        }
        this.transformControls.addEventListener("mouseDown",  this.onTransformBegin);

        this.onTransformEnd = () => {
            this.cameraControls.enablePan = true;
            this.cameraControls.enableZoom = true;
            this.cameraControls.enableRotate = true;
            this.game.gamePage.selectedObjectTransformChange();
        }
        this.transformControls.addEventListener("mouseUp", this.onTransformEnd);

        this.mouseMoveCallback = this.onMouseMove.bind(this);
        document.addEventListener('mousemove', this.mouseMoveCallback, false);
        this.mouseClickCallback = this.onMouseClick.bind(this);
        document.addEventListener('dblclick', this.mouseClickCallback, false);

        // load last auto-saved scene
        setTimeout(() => {
            this.loadScene();
        })

        // auto-save scene every 5 seconds
        setInterval(() => {
            this.saveScene();
        }, 4000)
    }

    /**
     * Update
     */
    update() {
        this.cameraControls.update();
        if (this.selectedBoxHelper) {
            this.selectedBoxHelper.update();
        }

        if (this.game._debugCanvasContext) {
            var width = this.game._debugCanvas.offsetWidth;
            var height = this.game._debugCanvas.offsetHeight;
            this.game._debugCanvasContext.clearRect(0, 0, width, height);

            if (this.highlightedObject) {
                var labelWidth = width * 0.1;
                var labelHeight = height * 0.05;
                var itemPadding = labelHeight * 0.3;
                this.game._debugCanvasContext.font = (labelHeight * 0.25) + "px Verdana";
                this.game._debugCanvasContext.textBaseline = "top";

                var point = this.game._projectPointToScreen(this.highlightedObject.position.clone().add(new THREE.Vector3(0, 1, 0)), width, height);
                var labelX = point.x - (labelWidth * 0.5);
                var labelY = point.y;
                
                this.game._debugCanvasContext.fillStyle = "rgba(0,0,0,0.5)";
                this.game._debugCanvasContext.fillRect(labelX, labelY, labelWidth, labelHeight);

                labelX += labelWidth * 0.05;
                if (this.highlightedObject._jgf_editor_object.gameObject) {
                    labelY += labelHeight * 0.1;
                } else {
                    labelY += labelHeight * 0.25;
                }
                this.game._debugCanvasContext.fillStyle = "White";
                this.game._debugCanvasContext.fillText(this.highlightedObject._jgf_editor_object.name, labelX, labelY, labelWidth);

                if (this.highlightedObject._jgf_editor_object.gameObject) {
                    labelY += itemPadding;
                    this.game._debugCanvasContext.fillStyle = "LightCyan";
                    this.game._debugCanvasContext.fillText("GameObject: " + this.highlightedObject._jgf_editor_object.gameObject, labelX, labelY, labelWidth);
                }

                labelY += itemPadding;
                this.game._debugCanvasContext.fillStyle = "Cornsilk";
                this.game._debugCanvasContext.fillText(
                    "X: " + Math.round(this.highlightedObject.position.x * 100) / 100
                    + " Y: " + Math.round(this.highlightedObject.position.y * 100) / 100
                    + " Z: " + Math.round(this.highlightedObject.position.z * 100) / 100
                , labelX, labelY, labelWidth);
            }
        }
    }

    /**
     * Destroy
     */
    destroy() {
        this.cameraControls.dispose();
        this.transformControls.dispose();
        this.game.removeFromScene(this.selectedBoxHelper);
        this.setGrid(null);
    }

    //#endregion
}

